Experimental_Aeon_010_010="[{i Choir}]: 银河巨像使用位于其「眼睛」的能量产生器来发射其致命的武器。当巨像被摧毁时，它的胸部打开，释出一个不稳定的能量球。它会烧焦所接触到的任何东西。"
Experimental_Aeon_010_020="[{i Choir}]: 但愿银河巨像消灭你的敌人。"
Experimental_Aeon_020_010="[{i Choir}]: 「暴风雪」是一艘巨大的战舰，配备湮没巨炮，从极远的距离外攻击敌人。它有一部内置的海军工厂提供支援，因此暴风雪可以依需要建造海军部队。"
Experimental_Aeon_020_020="[{i Choir}]: 现在你可以使用「暴风雪」了。"
Experimental_Aeon_030_010="[{i Choir}]: 「萨尔」是一个巨大的飞碟，它会发出一道强烈的能量束，消灭它 接触到的任何东西。萨尔也可以生产并停泊T1-T3空军部队。"
Experimental_Aeon_030_020="[{i Choir}]: 萨尔可以发射了。为了「万古」的荣耀！"
Experimental_Cybran_010_010="[{i QAI}]: 利用其重型微波激光产生器，「猴王」蜘蛛机器人可以在几秒钟之内消灭无数的部队。由于它的体积巨大，也可以压碎任何被它踩在脚下的部队 。"
Experimental_Cybran_010_020="[{i Ops}]: 「猴王」准备加入战斗 。"
Experimental_Cybran_010_030="[{i Ops}]: 蜘蛛机器人准备加入攻击。"
Experimental_Cybran_020_010="[{i QAI}]: 「劫掠者」是一款飞行重型武器平台。它配备一部重型铱火箭发射架以及重型电子炮，以强大的力量攻击地面部队 。"
Experimental_Cybran_020_020="[{i Ops}]: 你的「劫掠者」可以进行野战测试了，指挥官 。"
Experimental_Cybran_030_010="[{i QAI}]: 由于其机动性，「伤害者」几乎可以对任何目标发射火炮弹幕。它的射程不错，而且射击速度经过大幅度加强 。"
Experimental_Cybran_030_020="[{i Ops}]: 「伤害者」已经上线。"
Experimental_UEF_010_010="[{i EarthCom}]: 「胖小子」是一种陆地战舰。沿其外围置放的三联装加农炮可以发射极具破坏力的弹幕，后方的建造舱则提供优秀的建造功能 。"
Experimental_UEF_010_020="[{i EarthCom}]: 「胖小子」 已经完成建造。"
Experimental_UEF_020_010="[{i EarthCom}]: 「亚特兰蒂斯」航航母舰是地球海军最高级的空军发射单位。它可以建造、停泊空军部队，并且以轻型防空支持和鱼雷发射管为标准武装。"
Experimental_UEF_020_020="[{i EarthCom}]: 「亚特兰蒂斯」已经准备部署。"
Experimental_UEF_030_010="[{i EarthCom}]: 「马维」的射击舱经过修改，可以在极远距离外发射战术核炮弹。它的射程超越任何已知的武器。"
Experimental_UEF_030_020="[{i EarthCom}]: 「马维」开始运作了。"
