SCMP_001_Description="对星球的初步扫描显示有间隔平均的山丘，导致部份人认为这些山丘是古代外星人的坟墓。后续的扫描推翻这个理论，但是许多人认为旧的地球帝国确实发现过外星人的遗体，但他们把它偷偷带走，然后伪造扫描结果，做为掩饰的手段。"
SCMP_002_Description="技术上来说并不是湖，而是一团瓦斯，结合之后形成一片像水一样的液体。大部份的瓦斯成分不明，而且三个派系都急欲探勘该地区，发掘其秘密。"
SCMP_003_Description="德雷克以一位去世已久的帝国军官之名为名，奉命去平息一个分离主义运动，却发现自己面对的是一支有组织的军队。他被迫撤退到峡谷的对面边缘，也就是在那个地方，他得以聚集足够的部队发动反击。德雷克打败那些分离主义者，从此那个峡谷就以他为名。"
SCMP_004_Description="藏在水里千年之久，地壳变动使喷火口的水流干，露出「无尽的战争」所需要的质量资源。在其间的时候，稀疏的森林长了出来，虽然喷火口不断发生的战争往往破坏掉这些森林。"
SCMP_005_Description="这群岛屿曾经是走私者的天堂，它是以在这里做生意的那些「绅士」为名。现在这群岛屿上住着不同类型的绅士，也就是来自三个阵营的指挥官，彼此竞争星球的控制权。"
SCMP_006_Description="以早期一位探险者为名的伊昂路口曾经见识过无数的战役。相当开阔的地区和大量的质量积点导致多年连续不断的战争。"
SCMP_007_Description="「空手」是被冰雪包围的一小长条绿地，没有人能肯定最早是谁想出这个名字来的。传说中这里原是中立地带，各阵营的士兵都可以前来此地，不用担心受到攻击。因此，所有前来此地的人都是「空手」的，表示没有携带武器。"
SCMP_008_Description="多年以来，这些冰河一直都由「万古」进行开采，也是他们取的名字。但是，随着战役的进行，「万古」已经被驱离，冰河将属于能够守住这个地方的人所有。"
SCMP_009_Description="过去几年中，「塞顿之握」已经发生过数十次战斗。有耐心的搜索者可以在地里和水里发现数千个部队的遗物。"
SCMP_010_Description="曾有一个名叫「宋」的酋长将这个岛屿视为家。他选择此地，一方面因为这里极美，也因为这里的资源丰富。宋早已被赶走，但是留下的资源等候有能耐的人来开采。"
SCMP_011_Description="这里曾经是一块小型大陆，UEF在这里建造一处研究基地，进行先进武器测试。研究人员无法控制一项实验性武器，造成的爆炸毁了整个大陆，使它成为分散的岛屿。现在三个阵营都试图寻找这个武器的数据，以便利用。"
SCMP_012_Description="在殖民初期，开拓者知道要穿过拱道，向正北方走，就可以接触到文明。现在，「通道」比以前更加危险，都是因为经常在沙漠中来回发生的战斗所造成的。"
SCMP_013_Description="有时候两个指挥官需要秘密地点来进行私下决斗。「冬之决战」就是在必须进行私人决斗时的首选地点。"
SCMP_014_Description="古老的战士故事中会提到百慕达三角洲，船舰在此地会无故失踪。「百慕达之盒」也有类似的名声，只不过失踪的是指挥官。"
SCMP_015_Description="在几乎没有水和只有少许植物的情况，几乎没有理由要前来「旷野」。但是这里确实蕴藏着丰富的质量资源，因此成为指挥官交手的地点。"
SCMP_016_Description="「卡尼斯河」因为两件事而著称。第一是河，它是矿产的源头，尤其是黄金。第二则是它适合进行一对一的战斗。"
SCMP_017_Description="这个地方在各方面都很不起眼。但是，它却位于重要的网关枢纽处，能够轻易到达银河的许多地方。光是因为这一点，就有许多指挥官以性命相搏，要夺取这个地方。"
SCMP_018_Description="最初这个地区获得殖民时，山丘上建置了高塔，以监视整个地区。它被称为「哨兵点」，即使为它命名的人早已离开世界，这个名字仍然流传了下来。"
SCMP_019_Description="多年以前，一位名叫「芬恩」的指挥官被打败，被迫逃亡。后来他将对手引到一个小岛上，并且打败他。此后那座岛就以他为名。"
SCMP_020_Description="深渊是在一片正常海域中的不正常下陷区域，许多人认为它是外星人为了不明原因而制造的。虽然科学研究推翻这种看法，但光是外星科技的传说就足可吸引三个阵营的人为了取得此地控制权而猛烈地战斗不止。"
SCMP_021_Description="阿尔发七星被旧地球帝国标记为危险地带，被隔离了数百年之久。直到现在，各阵营才开始怀疑其原因。是因为那里有外星人，有瘟疫或病毒吗？没有人知道，但是各阵营愿意为了找出真相而发动战斗。"
SCMP_022_Description="「避难所」是一个荒废的冰雪星球上唯一可居住的地方，虽然不起眼，但是如果能在那里建造一个网关，就可以成为进一步作战的跳板。"
SCMP_023_Description="争夺世界的战争往往以一战决胜负。所有的行动、策略和预备都在最后一战中摊牌。在维加隘口的胜利即代表赢得整个星球。"
SCMP_024_Description="没有人知道这块特别的地形是怎么形成的。有人提出许多理论，但是答案可能永远不为人知。"
SCMP_025_Description="「殖民地」是一片广大海域中唯一可以居住的陆地，已经见识过多次战斗。现在这里已经被废弃，但指挥官仍然前来此地决定谁可以占领盐岩殖民地。"
SCMP_026_Description="Vya-3曾是一个远离战争的天堂。红沙尘塞住进气管，令电路板短路，连最强大的军队也动弹不得。但是新科技允许部队在这个恶劣的环境中运作，因此战斗回到这个红色星球上。"
SCMP_027_Description="「裂痕」被岩浆包围，只不过是还没有被火焰吞吃的一块突出岩石。尽管它的环境很危险，但是它拥有丰富的矿产，吸引各方的指挥官前来争夺其财富。"
SCMP_028_Description="「绿洲」曾经是昂贵的别墅和SPA的所在地，是富人和有关系人士的游乐场。水上满是游艇，你可以看到公司总裁和企业大亨聚集在此地。最后「万古」发现了绿洲，摧毁了别墅，改建神殿。现在，多年以后，无尽之战再度临到绿洲。"
SCMP_029_Description="机密"
SCMP_030_Description="这个星球原本是UEF海军测试的地点，多年前被「万古」占领。现在它是一个受人争夺的土地，各地的指挥官都试图取得这个地方。"
SCMP_031_Description="塞布兰人以为他们很幸运，能够找到这个拥有丰富资源的原始地区，可以建立新的聚落。但是「万古」很快就出现了，随后UEF也现身。现在这个聚落若能在无尽的战争中生存，就算是幸运了。"
SCMP_032_Description="在不同的时代里，「野地」或许是一片自然保育区。以其水道和浓厚的森林，各种生命蓬勃生长。但是「野地」很不幸地被选择成为网关的枢纽。现在它的森林里回响着武器交战的声音，水道中塞满了船舰的破损船身。"
SCMP_033_Description="「白火」是「万古」的秘密海军基地。「万古」建造了数百艘船舰，然后用来攻击未起疑心的敌人。他们几乎占领了这个星球，但是UEF聚集军队反击，最后摧毁了「白火」这个地区。现在，多年以后，战争重新出现在这个地方，每个人都决定将此地据为己有。"
SCMP_034_Description="枪手早已消失，但是想要决斗的指挥官知道，他们可以在「正午」找到场地。"
SCMP_035_Description="发现这个地方的第一批探勘者以为他们找到了天堂。温暖的水域，凉风，以及长沙滩，都是严酷银河中的休息圣地。消息传出，很快地每个人都想在天堂里占有一席之地。"
SCMP_036_Description="「炸岩」的开矿殖民地希望能够在沙漠之下找到财富。但是，关于丰富矿产的消息很快传出，现在这个殖民地得为了生存而奋战。"
SCMP_037_Description="又浓又咸的水沾在每一样东西上面，污染它碰触到的每一样东西。如果不是因为这个星球接近隔离区，根本不会有人想到这里来。"
SCMP_038_Description="以前常有强盗在这个地区横行，看着山丘之间的道路。强盗早已不存在，但是通道仍然是战斗的好地点。"
SCMP_039_Description="这里过去曾经是UEF的海军测试地，UEF会在地面上设置各种目标，再用各种船舰进行轰炸。这些设施早就被废弃了，但是丰富的数据和损毁的部队吸引了各阵营的指挥官。"
SCMP_040_Description="「水沟」没有任何大气、植物或动物，根本没有人想来。但是，它拥有惊人的矿产，使得它成为值得争夺的地点。"
