Unit_Description_0004="把一座战术巡航导弹发射器架设在ACU的背上。"
Unit_Description_0005="扩充可用的设计图数量并且增加ACU的建造速度及最大生命值。"
Unit_Description_0006="这个设备套件大幅强化ACU自我修复的速度。对于想要以攻击方式来运用其ACU的指挥官而言，这是一个好选择。"
Unit_Description_0007="取代科技等级二工程套装，扩充指挥官能够使用的设计图数量，并且进一步增加ACU的建造速度及最大生命值。"
Unit_Description_0008="增加主炮的伤害输出。同时增加主炮及超充能攻击的射程。"
Unit_Description_0009="和标准型的核导弹比较起来，短程战术核弹的射程较短，破坏范围较小，但是它仍然一样有效。战略导弹防御系统可以击落这些导弹。"
Unit_Description_0010="个人传送器允许指挥官几乎可以立即传送数里之远。个人传送器需要大量的能量才能启动。"
Unit_Description_0011="个人护盾的升级，护盾产生器力场扩大ACU的护盾保护的区域范围，允许指挥官保护其它部队。"
Unit_Description_0012="资源分配系统提供有效率的运算法，加强ACU产生资源的速度。"
Unit_Description_0013="在ACU周围产生一道护盾。需要能量来运作。"
Unit_Description_0014="工程机器人就像第二名工程师，协助ACU进行建造或维修工作。"
Unit_Description_0015="这会为ACU增加第二部工程机器人。在安装第一部工程机器人之后，才能安装第二部机器人。"
Unit_Description_0016="这个部队可以持续地重建及修复任何部队或建筑物。「副指挥官」透过量子闸门进行召唤。"
Unit_Description_0017="工程机器人就像第二名工程师，协助ACU进行建造或维修工作。"
Unit_Description_0018="在SACU周围产生一道护盾。需要能量来运行。"
Unit_Description_0019="扩展SACU个人护盾的半径范围。需要能量来运作。"
Unit_Description_0020="雷达干扰仪制造许多假的雷达影像，以混淆敌人。全方位侦测器可以看穿干扰。"
Unit_Description_0021="增加SACU的资源生产。"
Unit_Description_0022="这项升级大幅扩充标准内建SACU侦测系统的范围。对于喜欢在远离主基地之处行动的指挥官而言，这是很受欢迎的选择。"
Unit_Description_0023="运用强力空气喷射系统，高级冷却器可以更迅速地冷却装载在SACU上的任何武器。这样可以提高射击速度。"
Unit_Description_0024="装备标准SACU重型电浆炮，提升武器射程并造成范围伤害。"
Unit_Description_0025="UEF侦察车是一种快速轻装甲侦察载具，使用机枪和最新的侦测套件。"
Unit_Description_0026="机械战队的主要角色是支接火力支持。这种轻装甲地面部队牺牲伤害潜力及续战能力，获得优越的速度和机动力。"
Unit_Description_0027="「灰狼」是一种很具弹性的机动火炮部队。它的长射程、高弹道、以及区域性伤害，使它很适合用来软化敌人的机动部队。它难以抵挡能够迅速逼近的部队。"
Unit_Description_0028="惊人的快速射击速度，以及良好的炮塔追踪能力，使得「弓箭手」成为对付所有空中目标的上好防御力量；飞得最快的空中部队不在此限。"
Unit_Description_0029="「攻击者」是地球部队的主力，它将集中的火力和装甲装置在坚固的外壳里。最近攻击者的建筑计划获得升级，使它配备标准的高斯炮。"
Unit_Description_0030="「支柱」是UEF最重型的坦克，使用双管高斯加农炮，发射高爆弹药。以其厚重的装甲，「支柱」已经成为UEF军队的重要资产。"
Unit_Description_0031="虽然UEF的两栖坦克单发炮弹只能造成轻微的伤害，但是它的射击速度连皮最厚的部队也能快速解决。这个部队的气垫装置使它得以毫无阻碍地穿越最深的水域。"
Unit_Description_0032="运用它的战术巡航导弹，「煎饼」的射程和火力几乎是灰狼的两倍。它也具备较重型的装甲和稳定系统，允许它在移动时开火射击。"
Unit_Description_0033="「空击者」是机动装甲部队的优秀同伴，而且当指挥官无法建造重型的防空炮时，往往用来做为临时的基地防御。"
Unit_Description_0034="「对向盾」运用最新型的UEF脉冲护盾产生器。对向盾装置在机动底座上，保护移动中的部队非常有效。"
Unit_Description_0035="除了实验性部队之外，「泰坦」是UEF部队中最庞大、最强硬的。它使用两管重型等离子加农炮，使它拥有无与伦比的火力。"
Unit_Description_0036="移动缓慢的重型火炮。必须架设才能射击。"
Unit_Description_0037="装甲和火力与标准UEF战列舰相当，「胖小子」可以滚进敌方领土，不但有能量护盾保护自己，还可以实时建造一整支军队。"
Unit_Description_0038="UEF部队的标准侦察机，「蜂鸟」牺牲武器和装甲，换取先进光学套装，使它获得绝佳的视野。"
Unit_Description_0039="「气旋」是标准的UEF截击机，快速、灵活，使用联动的防空轨道跑做为武器。"
Unit_Description_0040="「烧灼者」是UEF空军的强力兵种，为一款有效的区域轰炸机，对付各种目标都有效，无论是机动还是静止目标。"
Unit_Description_0041="低阶运输机。能够载运最多6个单位。"
Unit_Description_0042="「毒刺」配备一柄机炮，以极高速度射击。运输夹使「毒刺」能够抬起一架轻型载具或机器人，并将它传送进战场里。"
Unit_Description_0043="「鹳鸟」是双尾翼飞机，携带「琵琶鱼」鱼雷为武装，对抗任何海军部队都有很好的效果。"
Unit_Description_0044="根据古代设计改装，「黑鸟」携带最新的电子设备，并拥有一部主动式雷达系统。虽然速度相当快，但是黑鸟缺少武器，而且很容易被截击机击落。"
Unit_Description_0045="重装甲，中阶运输机。配备机炮以及防空武器。能够载运最多12个单位。"
Unit_Description_0046="UEF战机技术的新一代革命性发展，「黄蜂」配备两具高速脉冲光束系统。这些光束可以对轻装甲敌方飞机造成极大的伤害。"
Unit_Description_0047="「大使」以单具轨道枪做为轻型防空支持和防御，与其战术核炸弹的威力互补。"
Unit_Description_0048="「毒刺」的升级，「阔剑」具备两部战术火箭发射器，使用穿甲弹；并配备防空轨道枪。它是无人可及的地面攻击平台。"
Unit_Description_0049="UEF护卫舰是为了提供火力支援及以雷达和声纳能力支持舰队而设计。雷雨级舰亦具备一部内置的雷达干扰仪。"
Unit_Description_0050="「虎鲨」攻击潜艇是一种威力强大而且快速的反海军部队。它具备双管前射鱼雷管，以及一挺等离子炮，在浮上水面时增加火力。"
Unit_Description_0051="「总督」的主要角色是防空平台。它容纳一个密集阵战术导弹拦截系统，一个SAM导弹系统，一具双管高斯炮，以及一具战术巡航导弹发射器。"
Unit_Description_0052="英勇级驱逐舰是直接火力支援和反潜武器的组合。英勇级舰包括一具「琵琶鱼」鱼雷管以及一个智能型深水炸弹发射器，可以拦截及摧毁敌人的鱼雷。"
Unit_Description_0053="「高峰级」战列舰是一种强大的岸轰及反舰船只。它具备三具三联装重型高斯炮、四具防空轨道炮，以及两具反导弹密集阵炮。"
Unit_Description_0054="战略导弹潜艇。配备远程战术导弹和一座战略导弹发射器。"
Unit_Description_0055="以其潜航的能力，「亚特兰蒂斯」可以安全地将一群飞机运送遥远的距离。它也可以生产空军部队并作为机动的空中作战平台。"
Unit_Description_0056="UEF最高指挥官说明"
Unit_Description_0057="DM-1是大部份殖民地和设施的标准点防御，就其建造和操作费用而言，为建筑物提供的破坏力算相当不错。"
Unit_Description_0058="UEF的基本空防是一种廉价而有效的防空炮。这种部队可以建造在地面和水上。当建造在水上时，它固定在稳定的浮台上。"
Unit_Description_0059="这种基本型反舰设施用于海岸防御，DN-1发射标准的UEF琵琶鱼鱼雷，几乎所有的UEF反舰部队都使用。DN-1只能建筑于海上。"
Unit_Description_0060="以灰质结砾岩（高级的混凝土）构成，这些墙既可阻挡敌人的行动，也可就直接火力提供少量防御。"
Unit_Description_0061="「三脚架」是一种威力强大的基地防御。因其三联装重型高斯炮而获得其良好的射程和射击速度，「三脚架」可以将进入射程的任何敌军部队击成碎片。"
Unit_Description_0062="「清空者」高射炮比轻型防空轨道炮更有威力，是UEF防空设施的要角。建造在水面上时，则建造在浮动平台上。"
Unit_Description_0063="「蜂屠」有六个旋转炮管，每分钟可射出12,000发子弹。结合精密的追踪软件，「蜂屠」可以用惊人的速度和准确度摧毁导弹。"
Unit_Description_0064="「海啸」可同时发射四枚「琵琶鱼」鱼雷，是UEF海防的最高级部队，防御最重要的海上及海岸设施。「海啸」只能建造在水面上。"
Unit_Description_0065="「脉冲」使用UEF最新的军事技术－脉冲护盾产生器。这种护盾产生器可以升级成为T3版本，具备更大的保护区。"
Unit_Description_0066="「天行者」地对空导弹系统在对付敌人的高端飞行器拥有无可比拟的强大优势，采用双联发可以在极短时间倾泻大量输出，造成及其严重的破坏，其建造在水面上时，这种地对空导弹发射器建造在飘浮平台上。"
Unit_Description_0067="「终结者」是为了摧毁来袭的战略导弹而设计。「终结者」必须奉命建造其拦截弹。"
Unit_Description_0068="T2护盾产生器的升级版大，HSD具备更大、更具抵抗力的护盾，但是运作费用也相对增加。"
Unit_Description_0069="固定式火炮。设计来攻击移动缓慢的单位和固定的建筑物。"
Unit_Description_0070="「阿罗哈」发射远距离巡航导弹，非常精准。每一枚导弹都是由发射器建造。必须命令这个部队建造其导弹。"
Unit_Description_0071="空中作战平台(ASP)是一个完整的加油及维修平台，用于延伸飞机的有效作战距离。"
Unit_Description_0072="「公爵」是UEF武力中最庞大的标准火炮，使用和「破坏者」机动火炮相同的反物质炮弹，但是射程远得多。"
Unit_Description_0073="「石器者」可以制造并储存最多五枚核导弹，放在一个特殊强化的储存舱中。必须命令这个部队建造自己的导弹。"
Unit_Description_0074="科技等级三量子网关可以召唤副指挥官进入战场。"
Unit_Description_0075="最先进的UEF战略武器，「马维」从极远的距离外提供破坏力强大且极精确的火力。「马维」可以无视距离，为战场提供火炮掩护。"
Unit_Description_0076="工程师是一种多功能建筑、维修、占领及开采部队。它有两栖功能，可以滑过水面建造海军设施。"
Unit_Description_0077="这是T1工程师的升级版，可以建造更复杂的建筑。它由T2工厂建造。"
Unit_Description_0078="这是T2工程师的升级版，可以建造更复杂的建筑。这是唯一能够建造实验性部队的工程师。它由T3工厂建造。"
Unit_Description_0079="陆军工厂建造作战所必须的基本行动部队。这个工厂只能建造地面部队。它可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0080="空军工厂建造作战所必须的基本空军部队。这个工厂只能建造空中部队。工厂可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0081="海军工厂建造作战所必须的基本海军部队。这个工厂只能建造海上部队。工厂可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0082="这是T1陆军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0083="这是T1空军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0084="这是T1海军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0085="这是T2陆军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0086="这是T2空军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0087="这是T2海军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0088="发电机是一种廉价、坚固、稳定的能量产生来源。发电机可以连接至其它建筑物，使连接之建筑物的运作费用略为降低。"
Unit_Description_0089="生产能量。必须盖在碳氢矿床上。紧邻碳氢发电厂建造的建筑物可获得加成。"
Unit_Description_0090="能量仓库组件提高指挥官的经济体系中的能量容量上限。建造在发电机旁边可以获得加成。"
Unit_Description_0091="汲取质量。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0092="质量制造机是一个灵巧的系统，可以将纯能量转换成可用的质量。能量费用极高，因此只有在质量偏低或没有时才使用。"
Unit_Description_0093="质量仓库组件提高指挥官的经济体系中的质量容量的上限。建造在汲取机及制造机旁边可以获得加成。"
Unit_Description_0094="融合反应炉是发电机的升级机型，建造费用很高。位于融合反应炉旁边的建筑物会提高其运作效率。"
Unit_Description_0095="中阶质量汲取机。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0096="融合反应炉阵列是最好的前线能量供应来源。将建筑物建立在融合反应炉阵列旁边，会提高其运作效率。"
Unit_Description_0097="高阶质量汲取机。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0098="质量制造设施可以用超高的能量成本生产少得可怜的质量。只有具备极大量能量的基础上才能够让这种设施运作。"
Unit_Description_0099="UEF的标准雷达设计是监视地方上有无未经授权者入侵的有效方法。轻型机种的探测范围和装甲有限，但是可以升级。"
Unit_Description_0100="UEF的声纳设施非常类似雷达系统。作为廉价、短程侦测机制，SP1表现得很好。SP1侦测器可以升级。"
Unit_Description_0101="SA2是轻型雷达系统的远程版。T2雷达设施可以升级为T3全方位侦测器。"
Unit_Description_0102="SP2是轻型声纳系统的远程版。这种科技等级二声纳设施可以从科技等级一机种升级，也可以成为机动型。"
Unit_Description_0103="匿踪力场产生器以先进雷达干扰域来掩护一片区域。这片干扰域使雷达无法发现在其中的部队，但是对于肉眼没有效果。"
Unit_Description_0104="SP3相当于机动版的远距声纳系统。除了优异的声纳距离和行动力之外，SP3还具备装置在底座上的鱼雷炮塔。"
Unit_Description_0105="全方位侦测器阵列是收集情报的极致手段。除了非常远的有效距离外，它也可以识破匿踪力场和其它的隐蔽技术。"
Unit_Description_0106="资源分配系统提供有效率的运算法，加强ACU产生资源的速度。"
Unit_Description_0107="隐蔽ACU不被光学侦测器察觉，并且增加最大生命值。能被全方位侦测器察觉。需要能量来运作。"
Unit_Description_0108="隐藏ACU不被雷达察觉。"
Unit_Description_0109="个人量子传送器允许指挥官几乎立即传送数里之远。传送器需要大量的能量才能启动。"
Unit_Description_0110="扩充可用的设计图数量并且增加ACU的建造速度及最大生命值。"
Unit_Description_0111="取代科技等级二工程套装，扩充指挥官能够使用的设计图数量，并且进一步增加ACU的建造速度及最大生命值。"
Unit_Description_0112="增加主炮的射击速度和射程。同时增加分子毁灭炮及超充能攻击的射程。"
Unit_Description_0113="微波激光产生器使ACU能够产生集束激光，扫掠敌人部队。"
Unit_Description_0114="以一门标准塞布兰纳奈鱼雷管和声纳装备ACU。"
Unit_Description_0115="这个部队可以持续地重建及修复任何部队或建筑物。「副指挥官」透过量子闸门进行召唤。"
Unit_Description_0116="隐蔽SCAU不被光学侦测器察觉。能被全方位侦测器察觉。需要能量来运作。"
Unit_Description_0117="EMP脉冲可以有效地关闭敌方单位几秒钟。"
Unit_Description_0118="脉冲激光的聚焦能力极大增强，提升武器射程并造成双倍伤害。"
Unit_Description_0119="纳奈导弹系统将标准的塞布兰地对空纳奈导弹系统加装到SACU上。这样使SACU获得可观的防空能力。"
Unit_Description_0120="资源分配系统提供有效率的运算法，加强ACU产生资源的速度。"
Unit_Description_0121="加速所有工程相关的功能。"
Unit_Description_0122="这个设备套件大幅强化SACU自我修复的速度。对于想要以攻击方式来运用其SACU的指挥官而言，这是一个好选择。"
Unit_Description_0123="隐藏SACU避免被雷达侦测。需要能量运作。"
Unit_Description_0124="「潜鼠」舍弃武器，腾出空间安装一个隐蔽力场，使「潜鼠」不致被肉眼发现，不过雷达仍然可以发现这个部队，而且全方位侦测器会使它曝露在光学传感器下。"
Unit_Description_0125="「猎人」是一种快速攻击机器人，以团体行动为设计理念。虽然它的装甲轻，造成的伤害普通，但是相当低廉的造价允许大量迅速生产，做为支援或轻型特遣队。"
Unit_Description_0126="「螳螂」的双手各用一把重型激光机枪，可以发射可观的火场。它也具备简化形工程套件，可以修复自己。"
Unit_Description_0127="「美杜莎」发射小型EMP榴弹，可以摧毁轻型部队，并严重破坏重型部队。"
Unit_Description_0128="「空锤」结合新型纳米镖系统，它会发射以火箭推动的小型镖，速度非凡，且具有导向能力。纳米镖也可以攻击地面目标。"
Unit_Description_0129="「犀牛」是许多塞布兰指挥官的最爱。它的双管粒子炮有极大的冲击力，正可实现其前线攻击者的角色。"
Unit_Description_0130="浮出水面时，「瓦格纳」使用重型电子炮。在潜航时，则用电子炮管发射鱼雷。"
Unit_Description_0131="「毒蛇」是美杜莎的升级，以罗亚导弹系统取代EMP榴弹。此外，「毒蛇」具备优秀的装甲和控制特性。"
Unit_Description_0132="「震撼者」发射炮弹会在一个小区域产生暂时性的电磁风暴。它会破坏敌人的电子系统，并使敌人系统失效，摧毁该部队。"
Unit_Description_0133="当机动匿踪系统启动时，雷达信号就变模糊。这种效果会使得与「欺骗者」联结的部队不会显示在敌人雷达上。但是对目视没有效果。"
Unit_Description_0134="「勤王者」是塞布兰人最重型的传统直接火力武器。它使用分解脉冲激光作为主要武装，并使用重型电子炮来对付轻型部队。"
Unit_Description_0135="移动缓慢的重型火炮，必须架设才能射击。"
Unit_Description_0136="「猴王」是陆地的主宰。它使用大量能量来操作其重型微波激光产生器，扫荡在其前方的任何敌人。"
Unit_Description_0137="「冷酷」速射炮使用热分散系统，让它得以迅速发射军队威力最强的炮弹。能量费用是射击速度唯一的限制。"
Unit_Description_0138="塞布兰侦察机是旧型设计，功能相当标准。它拥有不错的视距半径，高速，没有武器，而且轻装甲。"
Unit_Description_0139="快速、具机动性的战斗机。配备一门机炮。"
Unit_Description_0140="「宙斯」具备强大的推进力，其炸弹会在弹着之前引爆，造成庞大的区域破坏，使该地区曝露在放射线下。"
Unit_Description_0141="低阶运输机。可运载最多6个单位。"
Unit_Description_0142="「叛徒」是一种快速攻击直升机，用于提供地面支持。双管火箭筒可对地面目标发射火箭。"
Unit_Description_0143="「鹈鹕」投掷鱼雷，对海军船舰和建筑物造成严重的破坏。"
Unit_Description_0144="极为快速的间谍飞机，有着免费、永久的匿踪功能。\n"
Unit_Description_0145="中阶运输机。配备一门机炮及防空防御系统。可运载最多10个单位。"
Unit_Description_0146="「双子」具备一部纳奈导弹系统，分散射出多枚小导弹，使其命中率达到最大。它的装甲优于「游荡者」，但是仍然是相当轻型的部队。"
Unit_Description_0147="高阶战略轰炸机。配备一枚质子炸弹、匿踪力场产生器以及防空火炮。"
Unit_Description_0148="「死神」拥有巨大的火力以及前线上的空投威力。这种炮艇有强大的武器，包括一对重型铱火箭架。"
Unit_Description_0149="海军雷达和声纳平台。配备一门质子加农炮和一门防空机炮。\n"
Unit_Description_0150="「裂片」是优秀设计的第四代，银河中处处可见。它使用纳奈鱼雷发射器和装置在甲板上的重型激光，供海面作战之用。"
Unit_Description_0151="防空海军舰艇。配备防空炮塔及短程火箭平台。"
Unit_Description_0152="两栖驱逐舰。配备一具双联装质子加农炮、防空机炮以及鱼雷管。"
Unit_Description_0153="直接射击及轰炸海军战列舰。配备六门质子加农炮、双管防空机炮、反导弹炮塔以及鱼雷管。"
Unit_Description_0154="航母。可建造、停泊以及维修飞行器。配备轻型防空机炮和一具反导弹炮塔。"
Unit_Description_0155="战略导弹潜艇。配备一座战略导弹发射器、战术导弹发射器和鱼雷管。"
Unit_Description_0156="扩充可用的设计图数量并且增加ACU的建造速度及最大生命值。"
Unit_Description_0157="在ACU周围产生一道量子静止力场。在其范围内瘫痪敌方单位。高能量消耗量。"
Unit_Description_0158="光束强化仪将标准的ACU量子分裂光束送过一连串的透镜，大幅强化光束的凝聚力，也使其射程几乎加倍。"
Unit_Description_0159="大幅延伸ACU标准内建侦测系统的范围。"
Unit_Description_0160="取代科技等级二工程套装，扩充指挥官能够使用的设计图数量，并且进一步增加ACU的建造速度及最大生命值。"
Unit_Description_0161="安装散热器强化仪之后，ACU的量子分裂光束射速几乎可以提高一倍。"
Unit_Description_0162="资源分配系统提高ACU产生的资源量，高效能的运算法则加快转换过程。"
Unit_Description_0163="需要资源分配系统。进一步增加ACU的资源生产。"
Unit_Description_0164="在ACU周围产生一道护盾。需要能量来运作。"
Unit_Description_0165="强化围绕ACU的护盾。需要能量来运作。"
Unit_Description_0166="个人传送器允许指挥官几乎可以立即传送数里之远。个人传送器需要大量的能量才能启动。"
Unit_Description_0167="这个部队可以持续地重建及修复任何部队或建筑物。「副指挥官」透过量子闸门进行召唤。"
Unit_Description_0168="加速所有工程相关的功能。"
Unit_Description_0169="资源分配系统减少SACU的运作费用。"
Unit_Description_0170="副指挥官可以奉命牺牲，以便将其SACU的质量加入一栋建筑中。但是，新的副指挥官必须经由量子网关进行召唤。"
Unit_Description_0171="在启动时，个人护盾会在SACU周围创造一面个人护盾。在承受足够的伤害之后，需要充能之后才能再度启动。"
Unit_Description_0172="升级SACU的护盾。需要能量来运作。"
Unit_Description_0173="装备标准SACU反物质炮，提升武器射程并造成范围伤害。"
Unit_Description_0174="大幅增加SACU自我修复的速度。"
Unit_Description_0175="个人传送器允许副指挥官几乎可以立即传送数里之远。个人传送器需要大量的能量才能启动。"
Unit_Description_0176="T1点防御是平民及次要军事前哨的标准的地面防御，具备重型激光机炮，提供足够的防御，又不会影响当地的经济。"
Unit_Description_0177="「追踪者」采用标准的塞布兰防空机炮做为防空机制，而未使用直接射击激光。建造在水面上时，「追踪者」装设在浮台上。"
Unit_Description_0178="重新设计的炮塔，机炮以纳奈鱼雷管取代，并且装设在浮台设备上。它会发射标准的塞布兰纳奈鱼雷。"
Unit_Description_0179="和其它的阵营一样，塞布兰人使用模块化的墙段来保护建筑物，避免意外的入侵者和直接武器攻击。"
Unit_Description_0180="标准炮塔的升级，「塞勒布斯」配备三具垂直堆栈的粒子炮。"
Unit_Description_0181="这种坚固的炮塔具备和「震撼者」机动防空部队相同的武器。武器可以破坏电子设备，最后会导致敌人系统失效，摧毁部队。"
Unit_Description_0182="这种反导弹系统具备极快速的瞄准功能，可以迅速引爆来袭的导弹及火箭。建造在水面上时，必须装设在浮台上。"
Unit_Description_0183="重型鱼雷发射器使用和T1机型相同的纳奈鱼雷，但是会快速发射鱼雷，直到目标摧毁为止。"
Unit_Description_0184="ED1会拦截来袭的弹药和能量信号。这种护盾产生器可以升级四次，每一次都会提高其运作费用、半径及护盾的强度。"
Unit_Description_0185="「密尔米顿」凭恃的是其八具纳奈导弹系统的快速射击，它会连续发射导弹，直到目标被摧毁。"
Unit_Description_0186="「守护者」的设计是为了在来袭的战略导弹命中其目标前将之击落。必须命令「守护者」建造自己的防御导弹。"
Unit_Description_0187="重型火炮。设计来交战缓慢移动的单位和固定建筑物。"
Unit_Description_0188="这种战术导弹发射器采用「罗亚」导弹系统。每一具发射器中可以存放五枚导弹。必须命令这个部队建造自己的导弹。"
Unit_Description_0189="空中作战设施是一个完整的加油及维修平台，用于延伸飞机的有效作战距离。"
Unit_Description_0190="「分裂者」是塞布兰人最巨大的炮，拥有可观的射程与火力。唯一拥有更远射程的塞布兰部队是战略导弹发射器。"
Unit_Description_0191="内部建造舱让这种导弹发射器得以建造并储存多枚弹头，用于在战略层面消灭敌人。必须命令这个部队建造自己的导弹。"
Unit_Description_0192="「召唤者」可以召唤副指挥官进入战场。"
Unit_Description_0193="工程师是一种多功能建筑、维修、占领及开采部队。它有两栖功能，可以滑过水面建造海军设施。"
Unit_Description_0194="这是T1工程师的升级版，可以建造更复杂的建筑。它由T2工厂建造。"
Unit_Description_0195="这是T2工程师的升级版，可以建造更复杂的建筑。这是唯一能够建造实验性部队的工程师。它由T3工厂建造。"
Unit_Description_0196="陆军工厂建造作战所必须的基本行动部队。这个工厂只能建造地面部队。它可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0197="空军工厂建造作战所必须的基本空军部队。这个工厂只能建造空中部队。工厂可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0198="海军工厂建造作战所必须的基本海军部队。这个工厂只能建造海上部队。工厂可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0199="这是T1陆军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0200="这是T1空军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0201="这是T1海军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0202="这是T2陆军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0203="这是T2空军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0204="这是T2海军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0205="发电机是一种廉价、坚固、稳定的能量产生来源。发电机可以连接至其它建筑物，使连接之建筑物的运作费用略为降低。"
Unit_Description_0206="生产能量。必须盖在碳氢矿床上。紧邻碳氢发电厂建造的建筑物可获得加成。"
Unit_Description_0207="汲取质量。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0208="质量制造机是一个灵巧的系统，可以将纯能量转换成可用的质量。能量费用极高，因此只有在质量偏低或没有时才使用。"
Unit_Description_0209="质量仓库组件提高指挥官的经济体系中的质量容量的上限。建造在汲取机及制造机旁边以获得加成。"
Unit_Description_0210="能量仓库组件提高指挥官的经济体系中的能量容量上限。建造在发电机旁边以获得加成。"
Unit_Description_0211="T2是发电机的升级机型，建造费用很高。位于T2旁边的建筑物会提高其运作效率。"
Unit_Description_0212="中阶质量汲取机。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0213="离子反应炉是最好的能量供应来源。将建筑物建立在离子反应炉旁边，会提高其运作效率。"
Unit_Description_0214="高阶质量汲取机。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0215="质量制造设施可以用超高的能量成本生产少得可怜的质量。只有具备极大量能量的基础才能够让这种设施运作。"
Unit_Description_0216="基本塞布兰雷达的范围和装甲有限，但是建造费用极低。这个系统可以升级。"
Unit_Description_0217="塞布兰人的声纳设施非常类似雷达系统。作为廉价、短程侦测机制，基本级的「挪亚」表现得很好。这个系统可以升级。"
Unit_Description_0218="T2雷达系统是T1系统的远程版。T2雷达设施可以从T1机种升级，并升级为T3全方位侦测器。"
Unit_Description_0219="这是T1声纳系统的远程版。这个T2声纳设施可以从T1机种升级，也可以成为机动型。"
Unit_Description_0220="当这道力场启动时，位于其半径内的部队都不会显示在雷达上。但是「曙光」不能令部队从视线中消失。"
Unit_Description_0221="T3声纳平台是一款机动远程声纳系统。它具备一部匿踪力场产生器，能够在一定的半径内阻挡声纳信号。"
Unit_Description_0222="全方位侦测器阵列是收集情报的极致手段。除了非常远的有效距离外，它也可以打败匿踪力场和其它的隐蔽技术。"
Unit_Description_0223="具备快速而强力的武器，「灵魂」是具备优秀火力的良好侦察车。"
Unit_Description_0224="这些速度惊人的机器人是为了纯粹的破坏而设计。装置在双手上的短程声波脉冲炮会发射扇形的集中声波，破坏及瓦解固态物质。"
Unit_Description_0225="「极光」具备极轻的装甲，虽然它有绝佳的射程和破坏力。对其它阵营而言，他们幸运之处在于「极光」的分裂炮射速极低。"
Unit_Description_0226="「炽热」以大量炮弹来弥补其准确度不足的缺点。这些炮弹的爆炸半径很小，但是有可观的破坏力。"
Unit_Description_0227="「蓟勋」使用射速快的音波脉冲炮。这种武器的设计目的在于干扰飞机的轻装甲，并造成严重的结构破坏。"
Unit_Description_0228="「方尖碑」设有一具量子炮，是威力强大但射速慢的武器。所有的「方尖碑」都拥有光粒子护盾产生器，在启动时，可以在部队周围产生一面护盾。"
Unit_Description_0229="具备一部「蛇纹」战术导弹座，「追寻者」在中距离时相当有效，但是造成的破坏相当轻，需要多次攻击才能打败一个目标。"
Unit_Description_0230="「扬星」配备标准型防空费兹发射器。这种设备会产生「泡泡」，在量子层上伤害敌人，使得目标自行瓦解。"
Unit_Description_0231="「炼狱」使用电磁和动态发电机的组合，在大片区域产生护盾。通常它被用来为地面攻击提供额外的保护。"
Unit_Description_0232="拥有护盾的攻城战斗机器人。配备高强度激光。能够自我维修和开采质量。"
Unit_Description_0233="移动缓慢的重型火炮。无需架设就能射击。"
Unit_Description_0234="巨像携带一具起伏量子激光，可以把附近的部队烧成灰。此外，巨像可以使用牵引光束将较小型的部队拉进它的手中，并将它们压碎。"
Unit_Description_0235="为了遵循「万古」的简单、单一用途部队哲学，「幻象」只是一种高度制导导弹，具备先进光学传感器套件。"
Unit_Description_0236="这种截击机舍弃额外的系统，装设集中火力，以对付空中目标。「保护者」的音波脉冲炮正适合与敌机缠斗。"
Unit_Description_0237="「微光」释出一枚高爆药慢速炸弹。在炸弹引爆之后，会有一阵力场暂留，使部队暂时无法动弹。"
Unit_Description_0238="低阶运输机。可运载最多6个单位。"
Unit_Description_0239="这种炮艇具备四枪管轻型激光，装设在机腹下方。这种武器造成轻微破坏，但是射速非凡。"
Unit_Description_0240="「万古」的鱼雷轰炸机丢掷谐波深水炸弹，它会朝着目标前进并爆炸，破坏船壳的完整，并造成结构的破坏。"
Unit_Description_0241="「万古」最顶尖的机动情报部队是「先知」。虽然它缺少声纳的功能，但是拥有良好的飞行范围，以及庞大的视线和雷达涵盖面。"
Unit_Description_0242="中阶运输机。配备音波脉冲炮台。能够运载最多12个单位。"
Unit_Description_0243="「光冠」是第一次尝试将瑟拉芬技术融合到「万古」部队中。「光冠」的量子置换机炮可发射爆裂弹，就像高射炮一样。"
Unit_Description_0244="「震惊者」投掷夸克炸弹，其爆炸范围小，但是造成可观的破坏。「震惊者」也可以部署诱敌片，可以干扰敌人的瞄准计算机。"
Unit_Description_0245="「萨尔」最可怕的武器之一是装置在中央的巨大量子光束产生器。如果这还不够，「萨尔」可以制造并停泊整个联队的飞机。"
Unit_Description_0246="「信标」是「万古」海军的主力。它的雷达和声纳功能使它成为海战群的必要成员。它也具备对鱼雷的些许防护能力。"
Unit_Description_0247="「空灵」是专注的船舰猎人。它携带两管标准的万古克诺鱼雷，表现和其它阵营的攻击潜艇相当。"
Unit_Description_0248="「破片」为万古舰队提供防空支持。它携带标准的万古防空音波脉冲炮，牺牲装甲来换取额外的速度。"
Unit_Description_0249="为了提供优秀的防空保护而设计，「无尽」配备两管地对空「热诚」导弹发射器和双炮管的量子炮，提供直接火力支持。"
Unit_Description_0250="为了支接火力支持和潜艇猎杀而设计的「出走级」驱逐舰携带湮没炮，以及多种反潜艇和反鱼雷武器。"
Unit_Description_0251="「天兆级」携带三门湮没炮，尽管射速不高，却仍是极具破坏力的武器。两具「精灵」反导弹高射炮提供对战术导弹的保护。"
Unit_Description_0252="「基辅级」可以建造并停泊数个中队的飞机，并为降落的飞机加油和维修。它没有攻击武力，但是具备两管地对空「热诚」导弹发射器。"
Unit_Description_0253="战略导弹潜艇。配备蛇纹战术导弹和一座战略导弹发射器。"
Unit_Description_0254="「暴风雪」可以用重型克诺鱼雷发射器进行攻击。浮上水面时，该部队可以使用一门湮没炮。它也有能力在战场上建造支援舰队。"
Unit_Description_0255="「爆发者」是平民及次要军事前哨的标准地面防御，具备重力炮，提供足够的防御，又不会影响当地的经济。"
Unit_Description_0256="「追寻者」采用标准的万古防空脉冲炮，做为防空武力，而未使用直接射击武器。建造在水面上时，「追寻者」配备浮台。"
Unit_Description_0257="「潮浪」是价廉而有效的海军防御，使用标准的万古柯罗鱼雷管，装置在装甲轻薄的炮塔中。它只能建造在水面上。"
Unit_Description_0258="和其它的阵营一样，「万古」部队使用模块化的墙段来保护建筑物，避免意外的入侵者和直接武器攻击。"
Unit_Description_0259="「湮没」是因其使用的湮没炮而得名，是武力强大的防御炮塔。「万古」的湮没炮射速慢，但是破坏力强大，具有区域性的破坏效果。"
Unit_Description_0260="「万古」未使用标准高射炮，而使用标准型防空费兹发射器。这种设备会产生「泡泡」，在量子层上伤害敌人，使得目标自行瓦解。"
Unit_Description_0261="「火山」使用「精灵」战术导弹高射炮，它将来袭的导弹吸向它，再于安全地带将来袭的导弹或火箭引爆。它可以建造在水面上。"
Unit_Description_0262="T2是T1鱼雷发射器的装甲加强版，配备克诺鱼雷群发射器。"
Unit_Description_0263="「光盾」是「万古」的护盾。它结合电磁和动能产生器，抵挡来袭的导弹和其它武器。"
Unit_Description_0264="和其它防空系统不同，这种武器对其目标发射单独一枚「热诚者」导弹。建造于水面上时，这种地对空导弹发射器要建造在飘浮平台上。"
Unit_Description_0265="「保护者」的设计是为了在来袭的战略导弹命中其目标前将之击落。它可以容纳五枚导弹。必须命令「保护者」建造自己的御导弹。"
Unit_Description_0266="「光辉」是「光盾」的升级，可以吸收更多伤害，也有较大的保护半径。"
Unit_Description_0267="中阶火炮。设计来交战移动缓慢的单位和固定建筑物。"
Unit_Description_0268="这种武器可以制造并储存多达八枚「蛇纹」导弹。这些导弹会造成暴冲伤害，且有优异的持续火力。必须命令这个部队建造自己的导弹。"
Unit_Description_0269="「摇篮」是一个完整的加油及维修平台，用于延伸飞机的有效作战距离。"
Unit_Description_0270="「万古」最高级的火炮使用声音回馈弹，可在极远距离外造成极大破坏，且准确度惊人，但是射击速度降低。"
Unit_Description_0271="这种导弹发射器可以建造并储存五枚量子扭曲弹头。这些弹头提供绝佳的长程火力。必须命令这个部队建造自己的导弹。"
Unit_Description_0272="「传送门」可以召唤副指挥官。副指挥官可以协助维护及维修部队和建筑物。"
Unit_Description_0273="工程师是一种多功能建筑、维修、占领及开采部队。它有两栖功能，可以滑过水面建造海军设施。在建造过程中牺牲它，可以增加立即的建造值。"
Unit_Description_0274="这是T1工程师的升级版，可以建造更复杂的建筑。它由T2工厂建造。"
Unit_Description_0275="这是T2工程师的升级版，可以建造更复杂的建筑。这是唯一能够建造实验性部队的工程师。它由T3工厂建造。"
Unit_Description_0276="陆军工厂建造作战所必须的基本行动部队。这个工厂只能建造地面部队。它可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0277="空军工厂建造作战所必须的基本空军部队。这个工厂只能建造空中部队。工厂可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0278="海军工厂建造作战所必须的基本海军部队。这个工厂只能建造海上部队。工厂可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0279="这是T1陆军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0280="这是T1空军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0281="这是T1海军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0282="这是T2陆军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0283="这是T2空军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0284="这是T2海军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0285="发电机是一种廉价、坚固、稳定的能量产生来源。发电机可以连接至其它建筑物，使连接之建筑物的运作费用略为降低。"
Unit_Description_0286="生产能量。必须盖在碳氢矿床上。紧邻碳氢发电厂建造的建筑物可获得加成。"
Unit_Description_0287="能量仓库组件提高指挥官的经济体系中的能量容量上限。建造在发电机旁边以获得加成。"
Unit_Description_0288="汲取质量。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0289="质量制造机是一个灵巧的系统，可以将纯能量转换成可用的质量。能量费用极高，因此只有在质量偏低或没有时才使用。"
Unit_Description_0290="质量仓库组件提高指挥官的经济体系中的质量容量的上限。建造在汲取机及制造机旁边以获得加成。"
Unit_Description_0291="T2是发电机的升级机型，建造费用很高。位于T2旁边的建筑物会提高其运作效率。"
Unit_Description_0292="中阶质量汲取机。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0293="量子反应炉是最好的能量供应来源。将建筑物建立在量子反应炉旁边，会提高其运作效率。"
Unit_Description_0294="高阶质量汲取机。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0295="质量制造设施可以用超高的能量成本生产少得可怜的质量。只有具备极大量能量基础才能够让这种设施运作。"
Unit_Description_0296="基本雷达的范围和装甲有限，但是建造费用极低。这个系统可以升级，加强其范围及其它能力。"
Unit_Description_0297="「万古」的声纳设施非常类似雷达系统。这个系统可以升级，加强其范围及其它能力。"
Unit_Description_0298="T2雷达系统是T1系统的远程版。T2雷达设施可以从T1机种升级，并升级为T3全方位侦测器。"
Unit_Description_0299="这是T1声纳系统的远程版。这个T2声纳设施可以从T1机种升级，也可以成为机动型。"
Unit_Description_0300="匿踪力场产生器以先进雷达干扰域来掩护一片区域。这片干扰域使雷达无法发现在其中的部队，但是对于肉眼没有效果。"
Unit_Description_0301="声纳平台相当于机动版的远距声纳系统。它也包含一系列的反鱼雷发射器。T3声纳设施可以从T2机种升级而成。"
Unit_Description_0302="全方位侦测器阵列是收集情报的极致手段。除了非常远的有效距离外，它也可以打败匿踪力场和其它的隐蔽技术。"
