AITYPES_0010="硬派对手，偏好攻击部队，胜于科技升级。"
AITYPES_0011="硬派对手，在攻击部队和科技升级之间取得平衡。"
AITYPES_0012="硬派对手，偏好科技升级，胜于攻击部队。"
AITYPES_0013="随机选择的硬派对手，在大军、平衡和科技之间选择其一。"
Engine0013="无法开始"
Engine0014="「钢铁联盟」已经在执行中。"
Engine0015="请确认系统满足最低规格要求。"
MAINMENU_0010="LAN/IP"
SCORE_0060="杀敌／损失比例"
TU01_TUB200_001_020="指挥界面的鼠标按钮用来选择部队及命令他们去执各种行动。鼠标左键用于选择一个或多个部队。鼠标右键用于命令选择的部队和工厂采取行动。"
TU01_TUB200_001_030="要选择一个部队或工厂，请在HUD中指向该部队，再按鼠标左键。要选择一群部队，请按住鼠标左键不放，再于要选择的部队周围「拉」出一个方块；HUD就会回报你所选择的部队数量和种类。要选择窗口内某种类型的所有部队，只需要在该种类型的一个部队上双击鼠标键即可。注意，在缩小视野中，于一个部队上双击鼠标键，就会选择战争舞台中所有该类型的部队。\n"
TU01_TUB200_001_040="在选择部队或工厂之后，按鼠标右键即可发布命令。可以下达的命令视部队及状况而定。最简单的例子是基本的移动命令：选择一个部队，然后在该部队的目的地上按鼠标右键。"
TU01_TUB200_001_050="你下达的命令视部队及状况等背景而定。如果你选择一个部队，然后在友军部队上按鼠标右键，预设命令是「保护」。在敌方部队身上按鼠标右键的预设行动则是「攻击」。"
TU01_TUB200_001_055="工程师有不同的能力；他们预设的按鼠标右键行动与其它部队不同。光标的样子会指出按鼠标右键时所采取的行动，并且对应于HUD的指挥界面区。"
TU01_TUB200_001_060="透过指挥界面，也可以使用部队或一群部队能够进行的所有行动。在部队上按鼠标左键，然后在要执行的命令上按鼠标左键，再于HUD视野中的目的地或目标上按鼠标左键。"
TU01_TUB200_001_070="记住你刚才在学院中学到的东西：按鼠标左键以选择，按鼠标右键以行动！"
TU01_TUB425_010_045="举例来说，命令一个防空部队协助你的ACU，就会为你提供防空能力。记住，Shift键可以结合所有命令使用，以构成一连串的命令。举例来说，如果你要一个战斗部队在前往指定位置时避开敌方防御，那么就在发布多次移动命令时按住Shift键。"
TU01_TUB450_010_035="当你在建造队列中适当的部队图标上按鼠标左键时，就可以将部队加入队列中。同样地，在队列中的部队图标上按鼠标右键，即可将部队从建造队列中移除。你可以使用「停止」命令停止所有建造工作，移除队列中的所有部队。"
TU01_TUB450_010_055="你可以使用建造选项界面左侧的选择图示来存取不同的科技等级。建造队列中可以容纳任何科技等级的项目。科技等级三的工程师也可以使用位于科技等级三图标下方的专家级建造选项。"
TU01_TUB500_010_055="主要HUD检查区的右侧则是指挥官、可用工程师及其它重要部队的定位器。在图标上按鼠标右键即可找到这些部队并移到其位置。"
TU01_TUB600_010_040="在科技等级二时，你就可以使用相当可观的火力。机动导弹发射器和重型坦克皆可在远距离外有效对付任何地面部队或建筑物。两栖坦克可以行经水面和陆地，从料想不到的地方攻击敌人。"
TU01_TUB600_010_045="机动防空高射炮是对抗高级空中部队的基地防御的重要关键，也可以为你的探勘部队提供空中掩护。最后，机动护盾产生器是一种独特的防御部队，供基地和前线部队使用。"
TU01_TUB600_010_050="在科技等级三时，出现两种非常强大的部队：攻城机器人和机动火炮。这两种是你能够使用的最强大的传统部队。攻城机器人移动快速，可以在移动中发射强力的导弹，对付任何地面部队或建筑。它是指挥官杀手。火炮部队的机动力虽然比不上机器人，但是可以从远距离外攻击你的敌人，造成极大的破坏。"
TU01_TUB800_010_020="就和陆军及空军工厂一样，你的海军工厂建造科技等级一、2及3的部队，具备多样化的能力。在科技等级一等级，海军工厂可以建造护卫舰和潜艇。护卫舰是一种快速而具弹性的海军部队，同时具备海对海及海对地的武器，也有防空能力。"
TU01_TUB800_010_025="它适用于机动防御你的主要船舰、海军基地，以及陆上基地朝向海洋的那一面。科技等级一潜艇可以猎杀海上目标，包括水面上和水中的建筑物。"
TU01_TUB800_010_030="在科技等级二等级时，海军工厂为你的舰队提供强有力的生力军。驱逐舰具备强大的海对海及海对地的火力，而且配备声纳之后，可以提供优秀的反潜能力。巡洋舰具备强大的榴弹炮类型的对舰攻击能力及岸轰能力，并能在海上发射中程导弹。"
TU01_TUB800_010_040="在科技等级三等级，你可以生产敌人难以反制的海军部队。战列舰是一座飘浮的死亡岛屿，具备远距离巨炮、多项防空武器、设置在侧边的鱼雷发射器等等。战略导弹潜艇让你从海里发射核弹，攻击战争舞台上的任何目标。"
TU02_TUE200_001_020="「协助」命令对你的工程师而言特别重要。若要建立高输出等级的战斗部队，你派去协助工厂和其它工程师的工程师人数越多越好。一个简单的协助范例是让一名工程师去协助另一名工程师。这名工程师的建造队列中有多栋建筑物，我们可以选择它之后再按住Shift键，即可看到。"
TU02_TUE200_001_025="藉由命令另一位工程师去提供协助，建造工作就可以更快完成。协助的工程师越多，建筑完成的速度越快。透过按住Shift键，你可以看到有那些工程师在协助第一位工程师。派遣大量工程师去协助一名有建造队列的工程师，是很好的战略技巧。"
TU02_TUE200_001_030="在这个范例里，有一栋工厂的建造队列中塞满了前线需要的战斗部队。藉由发布「协助」命令，这些部队会更快建造完毕。如果向附近许多工程师发出「协助」命令，那么工厂的生产速度可以提高好几倍。你的ACU提供最佳的建造协助。"
TU02_TUE200_001_040="升级中的部队（例如这一部科技等级一质量汲取机）亦可以由工程师和你的ACU提供协助。所有的工程师命令都可以发布给你的ACU。"
TU02_TUE200_001_060="工程师的科技等级越高，他们的建筑能力就越好。（例如，科技等级三的工程师提供的协助高于科技等级一工程师。）当你的经济成长时，用几位科技等级二和科技等级三工程师去协助工厂，还有大群的助理工程师建造能量和质量建筑，并非不寻常的事。"
TU02_TUE200_001_070="记住，进行建造和协助的工程师会消耗能量及质量；如果你的经济亮起红灯，你可以暂停，或是停止工程师，以减少需求。"
TU04_TUC100_010_020="你的战争机器的建筑基础的能量和质量。若是二者不能稳定供应且不断成长，你对抗敌人的行动就会受到极大的阻碍。你可以建造科技等级一、2及3的发电机来获得能量。你也可以用工程师或ACU去开采星球上的天然资源，以获得能量。"
TU04_TUC100_010_025="在战役一开始的阶段里，开采能量非常重要。将发电机直接建造在工厂和其它特定建筑旁边，可以让你获得效率加成，并少量提升生产率。尽量利用这项特点。"
TU04_TUC100_010_030="你可以在质量积点上，从星球的核心开采质量；质量积点会标示在你的HUD上。你的ACU和工程师也可以开采星球表面的矿产资源。最后，你也可以建造科技等级一和科技等级三的质量制造机。要注意，质量制造机需要能量才能操作。"
TU04_TUC100_010_040="在你传送到新的战争舞台时，最好用你的ACU建造两到三台质量汲取机，然后建造两到三座科技等级一发电机，再开始建造工厂。"
TU04_TUC100_010_045="当工厂完工时，应该建造工程师，而且至少应该指派一些工程师去从事稳定制造能量和质量的活动：建造发电机和质量汲取机和制造机。在建设基地和军队的初期阶段，使用一些工程师去巡逻有丰富天然资源的地区也是有好处的，可以稳定初期的经济。"
TU04_TUC100_010_050="质量和能量仓库组件可以扩充经济的容量，并且降低过度生产的损失。在产量呈正面状态时建造仓库，可以在你的生产活动大增、而能量和质量的生产量不及消耗量时，给你一些帮助。只要你的仓库里还有能量及质量，工厂和工程师就可以全速进行操作。"
TU04_TUC115_010_020="我们来看看HUD中的经济指示器和地图覆层。在HUD的左上角和右上角是主要经济显示指示器。质量生产和消耗显示于左上角。能量生产和消耗显示于右上角。两个显示器的运作方式很类似。我们先从左上角的质量指示器开始。"
TU04_TUC115_010_030="质量使用者界面的主要组件是容量栏和质量生产指示器。这些读数的颜色和状态让你一眼就看到必须知道的信息。如果容量栏是满的，表示你的质量仓库容量是满的。仓库容量数字显示在容量栏的下方。如果你的质量生产指示器为正数且呈绿色，那么你生产的质量数量就大于消耗的数量。"
TU04_TUC115_010_035="最好的生产状况是绿色：质量仓库全满，以及正向的质量生产指示器。相反则是红色：负值生产，而且仓库里没有质量。黄色表示中间状况。根据你设定的HUD选项，如果生产状态到达危险的地步，就会出现警告。"
TU04_TUC115_010_040="生产指示器里面的小数字为你提供更多的细节：你正在生产的数量，以及你正在消耗的数量。你可以点击生产指示器，以切换数字或比例模式。在HUD的另一侧，能量生产使用者界面的使用方式就和质量使用者界面一样。"
TU04_TUC115_010_045="在HUD的中央，有一个百分比数值，让你知道总体经济状况和建筑中项目比较之下的效率：100%表示你以最快的速度进行建造。你应该尽可能把这个数字维持在50%以上，并尽量接近100%。"
TU04_TUC115_010_050="最后，让我们来看看经济覆层。你可以使用位于迷你地图附近的经济UI控制来启动覆层。在启动时，你可以清楚地看见那些部队和建筑物正在生产能量和质量，那些正在消耗能量和质量。注意，你的ACU在闲置时，会同时生产能量和质量；但是，在建造时，ACU会同时以高速度消耗二者。学习用HUD的使用者界面来了解经济状况。"
TU04_TUC200_010_020="指挥官可以在战场上运用许多策略。有许多策略是快速而具决定性的攻击行动，不一定需要庞大的能量和质量生产基础。在漫长的作战中，你就必须稳定地建设经济。"
TU04_TUC200_010_025="先前已经讨论过以科技等级一技术来建立初期的能量和质量生产机制；当你发展到科技等级二时，应该继续使用科技等级二发电机来累积资源，并将质量汲取机升级为科技等级二，甚至是科技等级三。重要的是不要一下子把所有的质量汲取机都升级。比较好的作法是让工程师协助质量汲取机进行升级。"
TU04_TUC200_010_030="在科技等级一时，指派一群工程师不断地建造新的发电机和质量汲取机及制造机，或许是个好策略。如果你建造大量的质量制造机，就要预备在能量生产停滞时，暂停一部份或全部。"
TU04_TUC200_010_035="在战略缩放视野中，于一部质量制造机上双击鼠标键，是暂停所有制造机的快速方法。要建造一群工程师来大量生产能量，有一个好方法，就是命令一名工程师进行建造，然后命令其它几个工程师去协助第一名工程师。"
TU04_TUC200_010_050="稳固的经济是透过渐次升级能量与质量生产而建立的。在科技等级二时，这表示要建造科技等级二发电机，并稳定地将质量汲取机升级至科技等级二和科技等级三。质量制造机可以用来平衡能量和质量的生产。"
TU04_TUC250_010_020="在冲突的所有阶段中都要避免经济停滞，这是很重要的一个观念，但是在开始阶段尤其重要。初期经济停滞往往是因为未能在建造工厂或其它建筑物之前，先建设初期的质量汲取及能量生产设施组合。"
TU04_TUC250_010_025="在完成能量和质量设施的建设之前，就用过多工程师超额建设，则是另外一个常见的原因。试图同时升级数座质量汲取机也应该避免。"
TU04_TUC250_010_030="当质量或能量HUD界面变成红色，或是收到警告讯息，或是容量栏偏低或变成零时，你就知道经济已经停滞。如果你的整体建造效率低于50%，这则是另外一个指标。有几个步骤可以让经济重回轨道。如果你的建筑工作过多，可以暂停一部份的工程师。"
TU04_TUC250_010_035="在这个例子里，我们过度建设，因此我们要暂停一部份工程师的动作，并将一些工程师从工厂转移到能量生产和质量升级。在这个例子里，我们因为同时升级三座质量汲取机而扼杀了经济；我们要暂停其中两座的升级。"
TU04_TUC250_010_040="在这个例子里，我们的质量生产还算不错，但是能量有问题－应该暂停质量制造机的生产。我们可以等到能量恢复正常之后，再解除制造机的暂停状态。"
TU04_TUC250_010_045="另外一个策略则是暂停工厂。我们在这里有由六间工厂组成的科技等级一战争机器，状况良好，但是我们的生产过多，因此要暂停一部份工厂的生产工作，将更多资源投注在建设经济设施。在经济再度起飞之后，记得要解除部队的暂停状态。"
TU05_TUA100_010_020="科技等级一空军工厂可以生产一种轻型运输机，能够运送工程师、战斗部队，甚至是你的ACU，前往战争舞台上的任何地面位置。科技等级一运输机有六组运输钩，一侧三个，最多可以装载六个部队，视部队的重量和体积而定。虽然科技等级一运输机的装甲轻，也没有机上武器，但是装载在机上的战斗部队可以从两侧射击，使你的运输机成为强大的炮艇。"
TU05_TUA100_010_030="运输机在空军基地里进行建造。有几种方式可以装载运输机：你可以选择一个部队或一群部队，再于HUD中指向要他们乘坐的运输工具；当「搭载」光标出现时，按鼠标右键。"
TU05_TUA100_010_035="如果部队在运输工具附近，他们就会移动过去，吸附在运输钩上。如果运输工具不在范围内，则运输工具会移到部队的位置并进行搭载。如果部队数过多，无法坐在一架运输工具中，而且你有多部运输工具可用，则选择要搭机的部队，再使用Shift键，对每一部运输机下达搭载命令。所有的部队都会登机。"
TU05_TUA100_010_040="要让运输工具的乘员离机，请选择运输工具，然后从部队命令选单中选择「运输」命令，再于目的地上按鼠标左键。你可以使用Shift键，在下达最后的运输命令之前先设定多点移动路线。这样可以让你在移动部队时避免被侦测，或避开防御。如果你把运输工具当做炮艇使用，只需使用移动或巡逻命令，指挥他们投入战斗。让有乘员的运输工具绕着敌人基地巡逻，可以造成极大的破坏。"
TU05_TUA200_010_020="运用你的运输工具，可以在两个地点之间设定自动摆渡路线。这样可以让你不断地在两点之间移动部队。要设定摆渡路线，请将运输工具放在第一个地点。在部队命令选单中选择「摆渡」命令，然后选择目的点。"
TU05_TUA200_010_025="运输工具会自动设置摆渡信标。如果运输工具上已经有乘员，它会开始第一轮运输。若是没有，它会在摆渡信标处等候并搭载部队，然后开始运送。"
TU05_TUA200_010_030="要让部队使用摆渡路线，重点在于你必须让部队前往摆渡信标，而不是运输工具本身。若以「搭载」命令搭乘运输工具，就会取消「摆渡」命令，信标会被摧毁。在这个例子里，我们选择了大批的部队，前往摆渡信标。运输工具会继续把他们全部运送到目的点。"
TU05_TUA200_010_050="你可以将部队直接自动从工厂送往摆渡点。选择工厂，在搭载光标出现时，于摆渡信标上按鼠标右键。如果有多间工厂的部队都被送往同一个摆渡信标，你可以轻松地利用运送派出大批部队。摆渡系统可以将部队稳定地送往前线。"
TU05_TUA400_010_020="在科技等级二和科技等级三，你可以建造护盾产生器来保护你的基地、ACU，或是其它任何你想加强防御的部队或位置。科技等级二和科技等级三产生器的差别在于它们的保护区域、防御力量，以及能量消耗率。护盾可以保护其保护范围内的部队，不受来自范围「外部」的攻击伤害；一旦地面部队穿透护盾，就没有保护作用。"
TU05_TUA400_010_025="基于这个原因，基地防御的有效策略之一是建造多个重迭的护盾。如果有一个被穿透或被破坏，你的重要部队仍然获得保护。在这个例子里，ACU受到三个重迭的护盾保护。"
TU05_TUA400_010_030="护盾消耗大量的能量。当你开始建造护盾时，你也必须确保继续不断供应能量。如果能量低于100%或变成负值，护盾就比较没有效用，而且会时有时无。"
TU05_TUA400_010_035="在这种情况下，使用护盾产生器的暂停功能来关闭较不重要的护盾，以供应能量给最重要的护盾。你应该以和护盾1:1的比例来建造新的发电机：每一面科技等级二护盾都需要一座科技等级二发电机；每一面科技等级三护盾都需要一座科技等级三发电机。同时也很重要的是护盾不能保护你免于核武攻击。"
TU05_TUA500_010_020="你最基本的情报收集部队是地面和侦察机，它们都是快速部队，具有极远的视距。持续利用这些部队进行侦察，是收集情报的最佳工具之一。"
TU05_TUA500_010_025="在科技等级一等级时，工程师也可以开始在地面上建造雷达站，在海上建造声纳站，以帮助你找到敌人的位置。许多指挥官会在战争舞台四处设置雷达；科技等级一雷达塔的造价不高。至于海上战斗，声纳是瞄准潜艇的必要设备。"
TU05_TUA500_010_030="在科技等级二等级，你可以部署长距离雷达：它类似科技等级一雷达，但是提供更远的距离。重点是科技等级一和科技等级二雷达都可以被反雷达部队愚弄或干扰。在科技等级二等级，你可以开始建造匿踪站，以干扰及反制敌方雷达。"
TU05_TUA500_010_035="匿踪塔可以涵盖一定的保护区域，而且消耗能量。对前进秘密基地而言尤其重要，你应该倚赖匿踪技术来进行情报战。注意，匿踪可以由高级的全方位雷达系统反制，这一点稍后讨论。"
