Unit_test_Description="多年以前，一位名叫「芬恩」的指挥官被打败，被迫逃亡。后来他将对手引到一个小岛上，并且打败他。此后那座岛就以他为名。"
X01_B01_001_010="我不明白这件该死的事是怎么发生的，不过这些杂种发现了我们。他们已经登陆并且开始攻击克拉克要塞和周边平民中心区。"
X01_B01_002_010="我们已经穷途末路了，指挥官。克拉克要塞是我们最后的作战基地，我们所有撤离路径全都被断绝，瑟拉芬和他们的仆人将毫无节制地屠杀银河系中每一名人类。"
X01_B01_002_020="除了坚守阵线我们别无选择。弗莱彻将军已经到星球上领导我们防守克拉克要塞。我们想开辟第二战场，这正是为什么你会传送到他位置南方的原因。"
X01_B01_002_030="这是你的降落区。这个位置有两座「教团」基地，而它们为「教团」进攻克拉克要塞提供支援。你必须摧毁所有「教团」建筑物，然后朝内陆推进。"
X01_B01_002_040="持续往北进攻直到你与弗来彻联系为止。一旦解除克拉克要塞的围攻，你们两人将直接攻击并消灭瑟拉芬指挥官。"
X01_B01_003_010="只许成功不许失败，指挥官。"
X01_DB01_010_010="[{i Hall}]: 尽管我们背水一战，不过你成功了，指挥官。克拉克要塞安全了，我们在对抗那些该死的外星人和他们的盟友上达成重大胜利。从今天起，我们必须杀出一条血路 。如果们要在这场战争中生存下来 ，我们必须能够与敌人正面交战。 而那正是我们打算做的事。"
X01_DB01_020_010="[{i Kael}]: 所有教团指挥官注意： 克拉克要塞已经沦陷，残余的UEF指挥建筑物已经被摧毁 ，联盟已不复存在。这是「启示教团」光荣的一天！我们胜利了！"
X01_M01_010_010="[{i HQ}]: 这是此区域两座敌人基地之一。把它们全轰回石器时代，然后与弗莱彻协同作战。"
X01_M01_020_010="[{i HQ}]: 如同赫尔所说，你的首要目标是攻击并摧毁位于你北方的两座「教团」基地。总部通话完毕 。"
X01_M01_030_010="[{i Fletcher}]: 你刚传送进入一个混乱的地狱 ，上校，不过我很高兴你在这里。"
X01_M01_040_010="[{i Fletcher}]: 塞布兰人，嗯？我还以为你们 这群家伙忙着帮布雷克曼的脑槽换水。"
X01_M01_040_020="[{i Dostya}]: 忽视他，指挥官。专注于眼前的战斗。多斯提亚通话完毕 。"
X01_M01_050_010="[{i Fletcher}]: 我监视着你，万古人。我还没忘记你们这些家伙在这场战争中干过的好事。"
X01_M01_050_020="[{i Rhiza}]: 不必理会他 ，勇士。为公主带来荣耀。"
X01_M01_060_010="[{i Gari}]: 联盟将在这天瓦解。没人能逃得出我们的愤怒。"
X01_M01_070_010="[{i HQ}]: 我们正上传「帕西瓦尔」设计图到你的ACU ；它是一种两栖攻城机器人，能够越过水域。总部通话完毕。"
X01_M01_080_010="[{i HQ}]: 我们正上传「砖块」设计图到你的 ACU。「砖块」是一种两栖攻城机器人。是布雷克曼博士另一个精心杰作。总部通话完毕。"
X01_M01_090_010="[{i Fletcher}]: 我真的用得上你在这里的协助，上校。可能的话尽快摧毁这些基地。"
X01_M01_100_010="[{i Fletcher}]: 直到你歼灭这些基地前 ，我们无法会合。"
X01_M01_105_010="[{i Fletcher}]: 停止浪费时间，快消灭这些基地。"
X01_M01_106_010="[{i Fletcher}]: 做点有用的事，快消灭这些基地！"
X01_M01_110_010="[{i Fletcher}]: 我开始觉得你根本不想为你的族人战斗。你到底有没有打算消灭这些基地？"
X01_M01_116_010="[{i Fletcher}]: 除非你取得进展，不然我们将失去克拉克要塞 。摧毁这些基地！"
X01_M01_117_010="[{i Hall}]: 指挥官，尽速往内陆移动是件非常紧急的事。无数人命危在旦夕。"
X01_M01_118_010="[{i Rhiza}]: 一位名叫盖芮的教团指挥官等着你 ，勇士。她是评断者凯尔其中一名钟爱的信徒；以公主之名消灭她。理萨通话完毕。"
X01_M01_120_010="[{i HQ}]: 那是两座基地。总部通 话完毕。"
X01_M01_130_010="[{i HQ}]: 消灭其中一座基地了。总部通话完 毕。"
X01_M01_140_010="[{i HQ}]: 基地全数消灭。开始往内陆推进。总部通话完毕。"
X01_M01_160_010="[{i HQ}]: 第一处火炮阵地已摧毁。总部通话完毕。"
X01_M01_170_010="[{i HQ}]: 确认第二处火炮阵地已摧毁。总部通话完毕。"
X01_M01_180_010="[{i HQ}]: 另一处火炮阵地已摧毁。总部通话完毕。"
X01_M01_190_010="[{i HQ}]: 干得好，那是第四处火炮阵地。总部通话完毕。"
X01_M01_200_010="[{i HQ}]: 那是最后一个─所有火炮阵地已全数消灭。总部通话完毕。"
X01_M01_210_010="[{i HQ}]: 这些火炮阵地有的还在运作。总部通话完毕。"
X01_M01_220_010="[{i HQ}]: 教团的火炮阵地还在 运作。总部通话完毕。"
X01_M01_230_010="[{i HQ}]: 那个疯女人正在攻击城镇。阻止她。总部通话完毕。"
X01_M01_OBJ_010_010="摧毁教团基地"
X01_M01_OBJ_010_020="往北移动越过海峡并且消灭指定的「教团」基地。"
X01_M01_OBJ_010_030="移动车队前进"
X01_M01_OBJ_010_040="火炮轰炸"
X01_M01_OBJ_020_010="清除火炮阵地"
X01_M01_OBJ_020_020="教团指挥官的火炮阵地射程涵盖你要越过的海峡。摧毁它们。"
X01_M02_010_010="[{i HQ}]: 治安官葛拉汉在通讯上 。我把他转接过来。"
X01_M02_010_020="[{i Graham}]: 指挥官，教团部队已经铲平我们大部分防御设施。我们已经从克拉克要塞被切断，而弗莱彻无法派来援军。我们需要你的协助。"
X01_M02_010_030="[{i Hall}]: 计划改变，指挥官。弗莱彻必须靠自己坚守克 拉克要塞久一点─你必须 保护平民并 且消灭该地 区中任何敌方 武力。"
X01_M02_010_040="[{i Gari}]: 我会净化这个星球所有人！与我的力量对抗愚 不可及！"
X01_M02_020_010="[{i Hall}]: 那个疯子正逼近平民百姓，指挥官。阻止她。"
X01_M02_030_010="[{i Hall}]: 保护平民！"
X01_M02_035_010="[{i Graham}]: 敌人正炮击我们，指挥官。我们支持不了太久 。请想点办法！"
X01_M02_035_020="[{i Hall}]: 保护那些建筑物，指挥官！"
X01_M02_035_030="[{i Gari}]: 这些人民会是献给我们的神的好祭品。"
X01_M02_036_010="[{i Hall}]: 我们不能失去避难所，指挥官。"
X01_M02_037_010="[{i Graham}]: 我们从四面八方受到攻击！噢，神啊，请帮助我们…"
X01_M02_038_010="[{i Graham}]: 我们需要协助，指挥官 ！"
X01_M02_039_010="[{i Graham}]: 平民安全了。你的大恩我永生难忘 ，指挥官。"
X01_M02_040_010="[{i Graham}]: 噢，不…他们摧毁了整座城镇。这些平民全都 …死了。"
X01_M02_041_010="[{i Graham}]: 避难所暂时安全了，上校，不过我不认为人们可以活过另一场攻击。万一教团指挥官再次袭击我们…"
X01_M02_041_020="[{i Graham}]: 还有另一个麻烦 ，上校。你的位 置东边有第二座城镇。虽然教团指挥官还没对它下手 ，不过这只是时间问题罢了。请保护它。"
X01_M02_041_022="[{i Hall}]: 我要那些平民离开那里，上校。治安官葛拉汉正安排一队可用的卡车给你；用它们撤离平民到城市中心。"
X01_M02_041_025="[{i HQ}]: 你必须告诉 这些卡车到你希望它们移动的位置。点击你抬头显示器右方，任务提示器下方的「命令信号」钮，然后点击卡车应该前往的位置。总部通话完毕。"
X01_M02_041_030="[{i Gari}]: 我的扫描显示一群卡车正要出发。不用说，载满了平民。 我应该会很乐于猎杀他们。"
X01_M02_045_010="[{i HQ}]: 敌方海军单位正进入射程，上校。在它们能轰炸城市之前将之击沈。总部通话完毕。"
X01_M02_047_010="[{i HQ}]: 敌人海军单位正进入射程，上校。在它们能轰炸城市之前将之击沈。总部通话完毕。"
X01_M02_050_010="[{i Hall}]: 有一辆卡车在开阔地，上校。命令它移动。"
X01_M02_060_010="[{i Graham}]: 指挥官，我们必须让这些卡车到达安全地点！"
X01_M02_070_010="[{i Graham}]: 卡车暴露了，上校！"
X01_M02_075_010="[{i Graham}]: 卡车正受到 损坏。"
X01_M02_077_010="[{i HQ}]: 教团指挥官正在攻击卡车。"
X01_M02_080_010="[{i Graham}]: 我们失去一辆卡车！"
X01_M02_090_010="[{i Graham}]: 他们摧毁了另一辆卡车 …拜托，上 校，保护平 民！"
X01_M02_100_010="[{i Graham}]: 噢，不…另一辆卡车被 摧毁了。我 们不能再失 去任何一辆 卡车。"
X01_M02_160_010="[{i Graham}]: 平民都死了…没人活下 来…"
X01_M02_160_020="[{i Gari}]: 哈哈哈！"
X01_M02_170_010="[{i Graham}]: 一辆卡车抵达了城市中心，长官。"
X01_M02_180_010="[{i Graham}]: 第二辆卡车安全了。"
X01_M02_190_010="[{i Graham}]: 所有卡车都抵达，我们也让平民到达安全地点。感激不尽，上校。"
X01_M02_200_010="[{i Graham}]: 太多卡车被摧毁…完了…"
X01_M02_210_010="[{i Hall}]: 干得好，上校。我非常高兴有你在UEF。"
X01_M02_240_010="[{i HQ}]: 危机还没有解除，指挥官。扫描显示教团部队正在集结，准备从北方发动反击。总部通话完毕。"
X01_M02_240_020="[{i HQ}]: 教团指挥官发动攻击了。战况会变得很糟糕。总部通话完毕。"
X01_M02_245_010="[{i HQ}]: 教团指挥官正移动狙击机器人进入阵地。它们行动快速而且火力强大，不过装甲不堪一击。总部通话完毕。"
X01_M02_250_010="[{i Gari}]: 终于，UEF的末日就在我眼前。期待已久的一天即将到来。"
X01_M02_250_020="[{i Hall}]: 我们会和你们奋战到底 。"
X01_M02_260_010="[{i Gari}]: 当我解决这里，我会找出并消灭你们钟爱的布雷克曼博士。而且没有人能够阻止我。"
X01_M02_260_020="[{i Dostya}]: 我们会与你们战斗到最后一口气。"
X01_M02_270_010="[{i Gari}]: 你抛弃了你的人民、你的传统和神。为此，你必须受死。"
X01_M02_270_020="[{i Rhiza}]: 你们用狂热主义扭曲了「道」。为此，你必须受死。"
X01_M02_280_010="[{i HQ}]: 敌人反击已经开始。总部通话完毕 。"
X01_M02_290_010="[{i Hall}]: 那个教团指挥官已经造成我们太多悲伤─袭击她的阵地并且消灭她。"
X01_M02_290_020="[{i HQ}]: 你听见命令了，指挥官 。移动到内陆与盖芮交战。"
X01_M02_290_030="[{i HQ}]: 还有一件事：我接收到你前进路线上几座小城镇的求救信号。如果可能的话协助他们，不过消灭盖芮是你的首要任务。"
X01_M02_320_010="[{i HQ}]: 那确实是个美景。也许下一位教团指挥官不会这么急着说大话。总部通话完毕。"
X01_M02_330_010="[{i Rhiza}]: 凯尔知道这件事会气得跳脚！荣耀归于公主！理萨通话完毕。"
X01_M02_OBJ_010_010="保护「西普林」的平民"
X01_M02_OBJ_010_020="至少50％平民建筑物必须完整无损。"
X01_M02_OBJ_010_030="撑过教团的反击"
X01_M02_OBJ_010_040="教团发动了一场大规模的反击！支撑过这场攻击，然后前去对付教团指挥官。"
X01_M02_OBJ_010_050="击败教团指挥官盖芮"
X01_M02_OBJ_010_060="如果要解救克拉克要塞，必须击败盖芮。"
X01_M02_OBJ_020_010="拯救平民殖民地"
X01_M02_OBJ_020_020="保护东方殖民地至少50％平民建筑物。"
X01_M02_OBJ_020_030="撤离殖民地"
X01_M02_OBJ_020_040="使用「命令信号」移动疏散人员到西普林城镇。十辆卡车中至少要有六辆安全抵达。"
X01_M02_OBJ_020_050="保护平民建筑物III（UEF）"
X01_M02_OBJ_020_060="保护平民建筑物III（UEF）"
X01_M03_010_010="[{i HQ}]: 克拉克要塞位于西北方 ，而瑟拉芬指挥官在东北方。那个外星人大概很不爽你杀了他的心肝宝贝，所以做好万全准备面对一切。克拉克要塞必须撑过攻击。总部通话完毕。"
X01_M03_020_010="[{i Fletcher}]: 瑟拉芬部队已经突穿我的防御，上校，而且他们正在攻击战略性资产 。"
X01_M03_030_010="[{i Fletcher}]: 瑟拉芬在加强攻势！我需要协助！"
X01_M03_040_010="[{i Fletcher}]: 你这个电线混蛋快滚过来帮我防守要塞！"
X01_M03_050_010="[{i Fletcher}]: 协助我防御要塞，塞布兰人！"
X01_M03_060_010="[{i Fletcher}]: 别浪费时间，快派一些援军过来这里！要塞正承受严重的损坏！"
X01_M03_070_010="[{i Fletcher}]: 克拉克要塞受到猛烈攻击！我需要部队马上到这里来！"
X01_M03_080_010="[{i Fletcher}]: 我被打得很惨，上校。我真的需要帮忙！"
X01_M03_090_010="[{i Fletcher}]: 这里是弗莱彻将军请求支援！瑟拉芬部队正对我猛烈攻击！"
X01_M03_100_010="[{i Fletcher}]: 我的援军在哪里？"
X01_M03_120_010="[{i Fletcher}]: 那个外星怪胎在我的正东方。从南方攻击那处位置，而我将从西方推进。他无法一次防守两边战线 。"
X01_M03_122_010="[{i Fletcher}]: 那个外星怪胎在我的正东方。他有一些实验性单位在四周大肆破坏，我们也必须摧毁这些单位。从南方攻击那处位置，而我将从西方推进。他无法一次防守两边战线。"
X01_M03_130_010="[{i Fletcher}]: 你是要坐着看戏还是要过来插一脚 ？瑟拉芬人在我的东方。攻击他。"
X01_M03_130_020="[{i Dostya}]: 击败瑟拉芬，指挥官。让这个笨蛋看看塞布兰人是怎么战斗的。多斯提亚通话完毕。"
X01_M03_133_010="[{i Fletcher}]: 你是要坐着看戏还是要过来插一脚？瑟拉芬人在我的东方，而且他有一群实验性单位。消灭他们。"
X01_M03_133_020="[{i Dostya}]: 击败瑟拉芬 和他的实验 性单位，指挥官。让这个笨蛋看看塞布兰人是怎么战斗的。多斯提亚通话完毕。"
X01_M03_140_010="[{i Fletcher}]: 也该是时候了！瑟拉芬在克拉克要塞东方。证明你的用处并且试图让他分心。"
X01_M03_140_020="[{i Rhiza}]: 他不明白你的价值，勇士。亲自击败瑟拉芬让他瞧瞧我们的力量。理萨通话完毕 。"
X01_M03_142_010="[{i Fletcher}]: 也该是时候了！瑟拉芬在克拉克要塞东方，而且他有一群实验性单位。证明你的用处并且试图让他们分心。"
X01_M03_142_020="[{i Rhiza}]: 他不明白你的价值，勇士。亲自击败瑟拉芬和他的单位。理萨通话完毕。"
X01_M03_150_010="[{i HQ}]: 技术人员刚 刚已经让新 的实验性卫 星光束武器上线。点击你的抬头显示器左方的「命令信号」，然后点击你的目标。我们会从那里接手。"
X01_M03_160_010="[{i HQ}]: 该死，冷却系统失效。 我们无法再次射击。总部通话完毕 。"
X01_M03_170_010="[{i Fletcher}]: 那是我最爱看的。烧吧，宝贝，烧吧！"
X01_M03_180_010="[{i Fletcher}]: 你在寻找勋章还是什么东西？战斗还没结束。"
X01_M03_190_010="[{i Fletcher}]: 也许你们这些怪胎有战斗的意愿。"
X01_M03_200_010="[{i Fletcher}]: 那个瑟拉芬还没死透，上校。我们收拾他吧。"
X01_M03_210_010="[{i Fletcher}]: 我们必须消灭那个瑟拉芬 ，上校。"
X01_M03_220_010="[{i Fletcher}]: 赶快进攻，塞布兰人！我们得除掉那个瑟拉芬 ！"
X01_M03_230_010="[{i Fletcher}]: 你在等那个外星人寿终正寝吗？"
X01_M03_240_010="[{i Fletcher}]: 来这里帮我解决瑟拉芬。"
X01_M03_250_010="[{i Fletcher}]: 你在等那个瑟拉芬寿终正寝吗？"
X01_M03_260_010="[{i Fletcher}]: 那个外星怪胎开始变弱了。再攻击他！"
X01_M03_270_010="[{i Fletcher}]: 我们让他疲于奔命。"
X01_M03_280_010="[{i Fletcher}]: 他撑不了多久。让他对地球的所作所为付出代价。"
X01_M03_290_010="[{i HQ}]: 弗莱彻，有一个大型实验性单位正接近克拉克要塞。那个外星人还没被击败。总部通话完毕。"
X01_M03_290_020="[{i Fletcher}]: 我看到它了！指挥官，用你全部武力攻击那个东西！"
X01_M03_292_010="[{i HQ}]: 也许他们再向那样攻击之前会三思。总部通话完毕。"
X01_M03_295_010="[{i ShunUllevash}]: [语言无法理解。]"
X01_M03_297_010="[{i Hall}]: 所有敌方部队都已经击败，而且克拉克要塞安全了。干得好，指挥官。这是一次我们的重大胜利。"
X01_M03_300_010="[{i Hall}]: 守住阵线，上校！我们必须保护平民。赫尔通话完毕。"
X01_M03_310_010="[{i Rhiza}]: 盖芮证实只会说大话而已。集中于瑟拉芬并且击败他。在一天之内失去两人会激怒凯尔并且为「忠诚者」带来信心 。理萨通话完毕 。"
X01_M03_OBJ_010_010="保护克拉克要塞"
X01_M03_OBJ_010_020="联盟领袖必须存活。不惜一切代价保护联盟政府大楼"
X01_M03_OBJ_010_030="击败瑟拉芬指挥官"
X01_M03_OBJ_010_040="摧毁瑟拉芬ACU以阻止葛理芬四号星的侵略。"
X01_T01_001_010="[{i Gari}]: 我不会允许你建造那个实验性单位 。"
X01_T01_002_010="[{i Gari}]: 不，你不会完成那个实验性单位。"
X01_T01_003_010="[{i Gari}]: 实验性单位？我不会笨到让它建造 完成。"
X01_T01_010_010="[{i Gari}]: 你永远到不了克拉克要塞。"
X01_T01_020_010="[{i Gari}]: 我会持续进逼你心爱的克拉克要塞。很快地它将烧成灰烬 。"
X01_T01_030_010="[{i Gari}]: 你只是在拖延不可避免的事。我将净化平民。"
X01_T01_040_010="[{i Gari}]: 你的顽强令人激赏，不过这场战斗的结果很早已前就已经 分胜负。"
X01_T01_050_010="[{i Gari}]: 你或许阻止了我，不过与瑟拉芬对抗你毫无希望。"
X01_T01_060_010="[{i Gari}]: 此刻你将感受「启示教团」的愤怒。"
X01_T01_070_010="[{i Gari}]: 你无处可藏、哪里也跑不了。"
X01_T01_080_010="[{i Gari}]: 这个星球的命运将和地球一样。"
X01_T01_090_010="[{i Gari}]: 你们的公主已死。只有「启示教团」长存。"
X01_T01_100_010="[{i Gari}]: 甚至是你们最强大的武器也无法与我对抗。"
X01_T01_110_010="[{i Gari}]: 求饶吧，也许我会赐给你荣耀一死。"
X01_T01_120_010="[{i Gari}]: UEF完了。这回你们无法从我们手上逃脱。"
X01_T01_130_010="[{i Gari}]: 一旦克拉克要塞陷落，我将净化这个星球上所有人。"
X01_T01_140_010="[{i Gari}]: 布雷克曼是年老痴呆的笨蛋。"
X01_T01_150_010="[{i Gari}]: 你是个讨厌的家伙。我会以消灭你为乐。"
X01_T01_160_010="[{i Gari}]: 拒绝瑟拉芬的你是个笨蛋。"
X01_T01_170_010="[{i Gari}]: 教团现在领导我们。你们的公主只不过是个消逝的记忆。"
X01_T01_175_010="[{i Gari}]: 公主已经死了。"
X01_T01_180_010="[{i Gari}]: 教团永存不朽。我们势无可档。"
X01_T01_190_010="[{i Gari}]: 瑟拉芬永远无法被击败！"
X01_T01_200_010="[{i Fletcher}]: 现在事情严重了。"
X01_T01_210_010="[{i Fletcher}]: 你们这些怪胎要为对地球的所作所为付出代价 。"
X01_T01_220_010="[{i Fletcher}]: 指挥官，我这需要你的帮忙。我被打的很惨。"
X01_T01_230_010="[{i Fletcher}]: 我麻烦大了！"
X01_T01_240_010="[{i Fletcher}]: 别开玩笑！"
X02_B01_001_010="卧底的万古「忠诚者」在一年多前渗透「教团」。他们的努力提供了我们重要的情报，而且他们也协助我们散播传言和公主殿下的实情。"
X02_B01_002_010="然而，整个「忠诚者」情报网正岌岌可危。"
X02_B01_002_020="QAI一直利用「哥白尼」行星作为攻击联盟宙域的集结地。为了遏止这些攻击，一群「忠诚者」对QAI的位置发动一场秘密军事行动。"
X02_B01_003_010="作战以失败告终。QAI早预料到这场攻击，它俘虏了三名「忠诚者」领袖。我们从过去的行动知道QAI会对他们植入AI芯片。这样的话，我们整个卧底网络将岌岌可危。"
X02_B01_004_010="此次作战的重要性不容低估，指挥官。很显然如今我们的安全通讯协议已经受到破坏。除此之外，我们的敌人不可能有其它方法得知克拉克要塞的秘密地点以及我们在这个星球的卧底行动。"
X02_B01_004_020="这种情况必须在失去控制前妥善处理。"
X02_B01_004_030="「忠诚者」仍然在星球上运作，不过他们已经无法展开救援任务。你将传送到这里，强化他们的阵地，然后拯救被QAI囚禁的「忠诚者」。"
X02_B01_004_040="一旦救出他们，你必须摧毁QAI的基地。有一名教团指挥官协助那个恐怖的机器。她曾经对公主殿下非常忠诚，不过如今已成为凯尔谎言的受害者。"
X02_B01_005_010="一位名叫塔丽雅的「忠诚者」间谍是你在这个星球上的联络人。一旦你抵达，她会有更多情报给你。你即刻传送。"
X02_B01_005_020="留意你的背后，指挥官。祝猎杀愉快。"
X02_D01_020_010="[{i Celene}]: 等等！我还没准备丧命！"
X02_D01_030_010="[{i QAI}]: 那只是个外壳。"
X02_DB01_010_010="[{i Rhiza}]: 指挥官，我想亲自感谢你协助我锺爱的「忠诚者者」。他们是我们对抗启示「教团」叛乱的第一线防御，失去他们将会是个致命打击。往后的日子将一片黑暗，但别失去勇气。我们最终的胜利比你想的还近。"
X02_DB01_020_010="[{i Thalia}]: 这里是塔利亚，我位于哥白尼行星上。联盟派来协助我们的武力已经被消灭了。QAI正靠近我们的位置，我们没有机会活下去。我们无法…"
X02_M01_010_010="[{i HQ}]: 赛兰妮正发动攻击对付忠诚者，你必须击败她。让快乐时光开始吧。总部通话完毕。"
X02_M01_020_010="[{i Thalia}]: 哼，我没料到理萨竟会派个UEF指挥官来。赛兰妮的部队正在攻击我的基地。塔丽雅通话完毕。"
X02_M01_025_010="[{i Thalia}]: 一个塞布兰人？在这里？赛兰妮正在攻击我的基地。消灭所有敌方部队。塔丽雅通话完毕。"
X02_M01_030_010="[{i Thalia}]: 勇士，这真是荣幸。赛兰妮正在攻击我的基地。请击退她的攻击并且将她打败。荣耀归于公主！"
X02_M01_040_010="[{i HQ}]: 你听见那位女士的话了，指挥官。总部通话完毕。"
X02_M01_045_010="[{i Thalia}]: 我成功窃取到教团「幽灵打击者」的设计图。它是你的了。用它为公主带来荣耀。"
X02_M01_045_020="[{i Rhiza}]: 干得好，塔利亚。"
X02_M01_050_010="[{i Celene}]: 你不了解准备对付你的力量。"
X02_M01_060_010="[{i Celene}]: 你在此出现只是亵渎这个星球。你是个令人厌恶的东西。"
X02_M01_070_010="[{i Celene}]: 放下你的武器并且拥抱瑟拉芬，勇士。这是你活着离开这个星球的唯一方式。"
X02_M01_070_020="[{i Rhiza}]: 赛兰妮，你曾经对公主殿下宣誓，但你却效忠她的敌人。你的誓言就这么毫无意义？"
X02_M01_070_030="[{i Celene}]: 公主死了，理萨。"
X02_M01_070_040="[{i Rhiza}]: 你错了。而你的叛变会让你付出巨大的代价。"
X02_M01_090_010="[{i Hall}]: 忠诚者对我们的成果极为重要；我们大多数可行动的情报皆出自于他们。我们必须尽一切可能支持他们。赫尔通话完毕。"
X02_M01_100_010="[{i Dostya}]: 我怀疑我们之间有个叛徒，不过我需要证据。我已经准备一种追踪病毒，它能让我们监控所有进出QAI的量子通讯。你必须想办法进入QAI的系统。多斯提亚通话完毕。"
X02_M01_110_010="[{i Thalia}]: 我们的基地仍然受到攻击。消灭敌人的部队。"
X02_M01_120_010="[{i Thalia}]: 赛兰妮的部队逐步进逼我们的位置。阻止它们。"
X02_M01_130_010="[{i Thalia}]: 扫描显示这个区域已经没有敌人了。谢谢你，指挥官。"
X02_M01_140_010="[{i Thalia}]: 忠诚者们死了，因为你无力击败赛兰妮的部队。这场战争输了。"
X02_M01_150_010="[{i Thalia}]: 你东北方有一处「教团」资源设施，它为赛兰妮基地中的护盾提供动力。攻击并摧毁那处资源设施中的发电机。塔丽雅通话完毕。"
X02_M01_150_020="[{i HQ}]: 我必须说，忠诚者还真的知道他们的本分。那些发电机是保持赛兰妮主基地护盾运作的设施。摧毁发电机护盾就完了。总部通话完毕。"
X02_M01_160_010="[{i Thalia}]: 发电机还在运作。摧毁它们。"
X02_M01_170_010="[{i Thalia}]: 摧毁那些发电机是极为重要的事。"
X02_M01_180_010="[{i Thalia}]: 干得好，指挥官。"
X02_M01_OBJ_010_010="击败教团的攻击"
X02_M01_OBJ_010_020="击败正在攻击「忠诚者」阵地的「教团」部队。"
X02_M01_OBJ_010_030="消灭「教团」前进基地"
X02_M01_OBJ_010_040="摧毁「教团」基地中标示的建筑物。"
X02_M01_OBJ_010_050="「忠诚者」游击队攻击"
X02_M01_OBJ_010_060="「萨尔」攻击"
X02_M01_OBJ_020_010="摧毁教团资源基地"
X02_M01_OBJ_020_015="摧毁标示的发电机瘫痪「教团」前进阵地中的护盾防御。"
X02_M02_010_010="[{i HQ}]: 接近那座监狱将会是一场战术梦魇。"
X02_M02_020_010="[{i Thalia}]: 你必须拯救其它忠诚者！时间宝贵！"
X02_M02_030_010="[{i Thalia}]: 如果QAI成功移植AI芯片，你将受到责难。"
X02_M02_040_010="[{i Mathea}]: 你及时救出我们，指挥官。QAI正开始AI移植最后阶段。多谢你。玛提通话完毕。"
X02_M02_050_010="[{i Thalia}]: 我们其中一位间谍准备好在战场任何地点安置炸弹，指挥官。爆破应该足以摧毁目标建筑物，所以明智地使用它。点击「命令信号」，然后点击目标以标示它。"
