X02_M02_170_030="[{i Princess}]: 教团已经背叛你。评断者凯尔寻求的是绝对的力量，而她将牺牲任何胆敢阻挡她去路的人。该是起来反抗并且拒绝她的教义的时候了，该是对抗那些企图消灭所有人性之人的时候了。以你们公主的名义奋起战斗吧！"
