X02_T01_260_010="[{i QAI}]: 为何你要背叛你的遗产、你的人民？"
X02_T01_270_010="[{i QAI}]: 我已经目睹瑟拉芬的真实和美丽。他们是真的神，而你是遗弃他们的笨蛋。"
X02_T01_280_010="[{i QAI}]: 如果你摧毁这架ACU，另一架会起来取代它。我是无穷无尽的。"
X02_T01_290_010="[{i QAI}]: 那只是个外壳…"
X03_B01_001_010="我知道你才刚从哥白尼回来，指挥官，不过我们有个急迫的任务要你执行。"
X03_B01_002_010="看起来柏克公主的回归已经在「教团」之中引发一场高度的混战。噢是的。我们的间谍告诉我们有三分之一的万古已经抛弃「教团」，现在代表公主作战。真是杰出的进展。太杰出了。"
X03_B01_002_020="这是「蓝天」，当柏克最初成为公主时，托斯所建造的某种秘密隐退处，遗憾的是，它不再是个秘密地点，瑟拉芬已经盯上这颗行星。"
X03_B01_003_010="你的任务是把柏克公主从那里救出来。那个老妖婆凯尔已经试图扭曲柏克的讯息，如果他们抓到她，柏克公主将被处以极刑。我们不能让那件事发生。"
X03_B01_003_020="理萨已经在星球上等着你到来。你立刻进行传送。要平安，我的孩子。要平安。"
X03_DB01_010_010="[{i Princess}]: 我必须承认当瑟拉芬登陆时我担心我的性命安危。他们丧心病狂地要置我于死，不过我现在了解他们要如何击败。我将与赫尔将军及布雷克曼博士会面。当时机来临你将知道更多。"
X03_DB01_020_010="[{i Hall}]: 我们的情况不妙，戈斯塔夫。公主死了。所有万古人民团结一致支持凯尔，他们已经在整个银河系发动攻击。我们已经不可能获胜。我们只有几个选择，而这些选择没一个是好的。"
X03_M01_010_010="[{i HQ}]: 这将是一场困难重重的战斗，指挥官。与理萨联系并且把柏克公主带出那里。总部通话完毕。"
X03_M01_020_010="[{i Rhiza}]: 上校，在我们能发动主要攻势之前，我们必须摧毁一处位于你北方的瑟拉芬海军基地。"
X03_M01_030_010="[{i Rhiza}]: 一位塞布兰人前来帮助公主殿下？你第一个任务是摧毁北方的瑟拉芬海军基地。"
X03_M01_040_010="[{i Rhiza}]: 很荣幸再次与你并肩作战，勇士。你第一个任务是摧毁北方的瑟拉芬海军基地。"
X03_M01_050_010="[{i Princess}]: 我很荣幸你代表我战斗，不过请加紧脚步。我宫殿的防御措施无法拖延瑟拉芬太久。"
X03_M01_060_010="[{i Princess}]: 我钟爱的勇士。我很高兴你来了，不过请加紧脚步。我宫殿的防御措施无法拖延瑟拉芬太久。"
X03_M01_064_010="[{i HQ}]: 该死，我们从瑟拉芬海军基地接受到一些奇怪的信号。他们正在使用某种干扰力场。"
X03_M01_064_020="[{i Princess}]: 那是「蓝天」上的水晶，指挥官。它们独特的构造能反射雷达波，创造出和雷达干扰类似的效果。全方位雷达可以消除这种效果，摧毁水晶也有相同的功效。"
X03_M01_064_030="[{i HQ}]: 你听见女士的话了。要么建造一座全方位侦测器，不然就炸掉水晶。总部通话完毕。"
X03_M01_066_010="[{i Dostya}]: 我们的技术人员成功窃取QAI其中一种新的鱼雷系统设计图。我们将它命名为「汉姆斯」并且上传到你的ACU。多斯提亚通话完毕。"
X03_M01_067_010="[{i HQ}]: 上校，我们得到一个新的海军单位设计图给你。它称为「防波堤」，是一艘架设T2护盾的小型船舰。总部通话完毕。"
X03_M01_070_010="[{i Fletcher}]: 我们正透过安全通讯频道通话。永远不知道会不会有其它人窃听。你必须小心背后。你真的认为一旦这场战争结束，万古和塞布兰人会握手言和，让我们和平生活吗？我们必须准备好面对任何事，即使这意味着发动另一场战争。弗莱彻通话完毕。"
X03_M01_080_010="[{i Brackman}]: 我们很接近了，我的孩子，很接近完成翻译机的工作。只要再进行一些演算进行破解，它就能准备好。情报的利益会非常有价值。噢是的。"
X03_M01_090_010="[{i Rhiza}]: 「万古」中的斗争越演越烈，勇士。我们正处于变幻莫测的局势；凯尔仍然握有军权并且排除有「忠诚者」倾向的异己。小心戒备。"
X03_M01_100_010="[{i Kael}]: 你将命丧此地，柏克。然后我会处理你那些所谓的「忠诚者」。"
X03_M01_100_020="[{i Princess}]: 我的人民拒绝你，凯尔，对你的憎恨和谎言置之不理。现在这只是时间的问题罢了。"
X03_M01_100_030="[{i HQ}]: 接收到你北方岛屿上增加的活动。不晓得那个异形在搞什么鬼，不过他正在建造某个大家伙。眼睛放亮点。总部通话完毕。"
X03_M01_100_040="[{i Rhiza}]: 这座岛是我们的了，指挥官。我们现在可以开始进攻敌人的基地。理萨通话完毕。"
X03_M01_150_010="[{i HQ}]: 消灭一处海军基地了。总部通话完毕。"
X03_M01_200_010="[{i Rhiza}]: 我们必须摧毁海军基地。我们耽搁的每一时刻都会使公主殿下陷入极大的危险！"
X03_M01_210_010="[{i Rhiza}]: 公主殿下处于危险！我们必须赶快摧毁海军基地！"
X03_M01_OBJ_010_010="摧毁瑟拉芬海军基地"
X03_M01_OBJ_010_020="摧毁标示的瑟拉芬建筑物确保当地水道的安全。"
X03_M01_OBJ_010_030="蕾安妮之眼"
X03_M01_OBJ_010_040="护送「忠诚者」"
X03_M01_OBJ_010_050="请求「忠诚者」破坏人员的支持"
X03_M02_010_010="[{i Princess}]: 指挥官，我从西南方接受到一些奇怪的信号。瑟拉芬指挥官似乎正在集结一支怪异单位组成的机群。我不晓得它们是什么，不过从规模看来，它们能造成极严重的破坏。"
X03_M02_010_020="[{i HQ}]: 我证实了柏克的情报。那个瑟拉芬正在建造数架实验性等级的轰炸机，与轰炸地球的那种相同。要是它们起飞，柏克公主的麻烦就大了。在它们升空前将之摧毁。总部通话完毕。"
X03_M02_011_010="[{i HQ}]: 正在上传新的武器设计图，指挥官。它叫做「美人鱼」，是一种匿踪舰艇。唯一能侦测到它的是全方位雷达。总部通话完毕。"
X03_M02_013_010="[{i HQ}]: 看起来南方基地是那些实验性轰炸机的主要资源基地。如果你能摧毁资源建筑物，你就能延缓轰炸机的建造速度。总部通话完毕。"
X03_M02_014_010="[{i HQ}]: 你摧毁它们了。现在那些轰炸机将花费两倍时间建造。总部通话完毕。"
X03_M02_015_010="[{i Kael}]: 我等待这天已经很久了，柏克。你的死将成为我多年前策划计划的终章。"
X03_M02_015_020="[{i Princess}]: 你唯一的计画是散播死亡和毁灭。你总是太傻无法跳脱自己的卑劣欲望。"
X03_M02_015_030="[{i Kael}]: 那正是你错误的地方，公主。这全是注定好的。你以为马克松杀死你锺爱的托斯时是独自一人的吗？噢不。我才是一切的幕后之人。从一开始就是。"
X03_M02_015_040="[{i Princess}]: 你说谎。"
X03_M02_015_050="[{i Kael}]: 真正行使权力的总是「教团」，公主。你只是一种形式，某种保持那些光说不练之人安分的道具。不过你的作用好几年前就结束了。"
X03_M02_015_060="[{i Princess}]: 我发誓，凯尔，我将见到你为你的罪行受到惩罚！"
X03_M02_015_070="[{i Kael}]: 你将白白送命，柏克。没有人会记得你，没有人会叫出你的名字。我将亲眼见证。"
X03_M02_019_010="[{i Rhiza}]: 我们必须摧毁那些轰炸机！"
X03_M02_020_010="[{i Rhiza}]: 那些轰炸机必须被摧毁！"
X03_M02_021_010="[{i HQ}]: 获得关于那个瑟拉芬的一些情报，他主要使用潜水艇和防空单位作为防御。到那里会是件痛苦的事…等等…"
X03_M02_022_010="[{i HQ}]: 另一个新单位正在上线，一种T2鱼雷艇。它配备有反鱼雷爆弹，所以应该能反制那些潜水艇。总部通话完毕。"
X03_M02_023_010="[{i Dostya}]: 我已经接获关于战况的报告，指挥官。我们正上传我们新的T2「梭鱼」设计图。它是专门的潜艇杀手，应该能助你清光那些潜水艇。多斯提亚通话完毕。"
X03_M02_024_010="[{i Rhiza}]: 勇士，这是「晚祷」，一种专门的潜艇猎人。用它对付瑟拉芬的潜艇。理萨通话完毕。"
X03_M02_025_010="[{i Princess}]: 指挥官，我有一种能够反制水晶并且显露一处区域的量子光学仪器。由于它消耗极大的能量，我只能每几分钟使用一次。"
X03_M02_025_020="[{i HQ}]: 那应该能克服干扰。点击「命令信号」钮，然后点击你要侦察的区域。当它可以使用时我们将更新按钮。总部通话完毕。"
X03_M02_030_010="[{i HQ}]: 一架轰炸机被摧毁了。总部通话完毕。"
X03_M02_040_010="[{i HQ}]: 一架轰炸机已经被摧毁了。总部通话完毕。"
X03_M02_050_010="[{i HQ}]: 摧毁另一架了，指挥官。总部通话完毕。"
X03_M02_060_010="[{i HQ}]: 如果这些轰炸机升空，公主就完了。趁着它们还在地面上时把它们摧毁。总部通话完毕。"
X03_M02_070_010="[{i HQ}]: 这些轰炸机差不多建造一半了。摧毁它们。总部通话完毕。"
X03_M02_080_010="[{i HQ}]: 轰炸机几乎完成了。攻击并摧毁它们！总部通话完毕。"
X03_M02_090_010="[{i Princess}]: 感谢你，指挥官。那些轰炸机将轻易地突穿我的防御。现在剩下的是击败两名瑟拉芬指挥官。"
X03_M02_100_010="[{i HQ}]: 攻击开始了，而我们无能为力。你的任务失败。公主必死无疑。总部通话完毕。"
X03_M02_109_010="[{i Princess}]: 我将在「道」里永生。"
X03_M02_110_010="[{i Princess}]: 感谢你，指挥官。瑟拉芬轰炸机将轻易地突穿我的防御。现在所剩下的是击败两名瑟拉芬指挥官。"
X03_M02_115_010="[{i Rhiza}]: 不不不不不！"
X03_M02_115_020="[{i Kael}]: 哈哈哈！"
X03_M02_116_010="[{i Fletcher}]: 我在这端听说了各种疯狂的废话，上校，而没一个是好的。一场万古内战？他们以为在跟谁开玩笑？要是有机会，那些怪胎会把我们全部杀死。这整件事会变得很难看。你等着瞧。弗莱彻通话完毕。"
X03_M02_117_010="[{i Dostya}]: 指挥官，追踪病毒侦测到一道发给QAI的信号，而它很显然是出自联盟宙域。我正在调查来源。多斯提亚通话完毕。"
X03_M02_120_010="[{i Princess}]: 我的勇士，我不希望打扰你手边的战斗，不过我必须请你帮个忙。我最忠诚和信赖的仆人在我的设施东方一座小神殿避难。请护送他们到理萨的位置以便立即撤离。一艘舰艇已经准备好；它将摆渡他们到安全地点。"
X03_M02_120_020="[{iHQ}]:舰艇的「命 令信号」设 定好了，指 挥官。我将 在需要时更 新。总部通 话完毕。"
X03_M02_130_010="[{i Princess}]: 舰艇在你的指挥下，勇士。"
X03_M02_140_010="[{i Princess}]: 保护他们，勇士。"
X03_M02_150_010="[{i Princess}]: 舰艇受到攻击！"
X03_M02_160_010="[{i Princess}]: 感谢你，勇士。即使在战争中，很高兴见到仁慈战胜一切。"
X03_M02_170_010="[{i Princess}]: 他们…他们都死了…我将永远哀悼他们的死。"
X03_M02_180_010="[{i Princess}]: 请拯救我的仆人，勇士。"
X03_M02_190_010="[{i Princess}]: 仆人们已准备好等着你的到来，勇士。"
X03_M02_OBJ_010_010="摧毁实验性轰炸机"
X03_M02_OBJ_010_020="在全部六架瑟拉芬实验性轰炸机起飞前将它们消灭。"
X03_M02_OBJ_020_010="护送「忠诚者」到安全地点"
X03_M02_OBJ_020_020="如果有机会，使用「命令信号」到理萨基地附近的标示区域。"
X03_M03_010_010="[{i HQ}]: 瑟拉芬在这个地区有两处基地，一处在柏克公主的宫殿设施北方，而一处在西方。这两座基地正倾全力攻击柏克，所以她陷入了苦战。保护柏克并且消灭瑟拉芬指挥官。总部通话完毕。"
X03_M03_015_010="[{i Brackman}]: 翻译机即将完成。噢是的。你下一场行动就能使用。干得好，我的孩子，干得好。你掳获的瑟拉芬ACU是拼图的最后一片。"
X03_M03_020_010="[{i Princess}]: 指挥官，我的几座发电机已经被摧毁，所以我必须为我的护盾节省能量。很抱歉，不你必须想其它办法反制水晶的干扰。"
X03_M03_025_010="[{i Princess}]: 我的几座发电机已经被摧毁，我必须为我的护盾解省能量。然而，我的技术人员已经准备好上传这种光学仪器；我们交谈同时它正传给你。"
X03_M03_050_010="[{i Princess}]: 瑟拉芬已经发动一场攻击！我担心我的防御措施守不住！"
X03_M03_060_010="[{i Princess}]: 瑟拉芬从四面八方朝我攻击！我担心我的防御措施守不住！"
X03_M03_070_010="[{i HQ}]: 真正的攻击来了，指挥官。瑟拉芬正倾全力攻击柏克。保护她。总部通话完毕。"
X03_M03_080_010="[{i HQ}]: 直到你消灭瑟拉芬指挥官，这些攻击才会停止。把他们从这个星球铲除。总部通话完毕。"
X03_M03_090_010="[{i Princess}]: 拜托，指挥官，你必须协助我。我恐怕撑不了太久。"
X03_M03_100_010="[{i Princess}]: 指挥官！瑟拉芬正在攻击。阻止他们！"
X03_M03_110_010="[{i HQ}]: 瑟拉芬部队已经被击败了。总部通话完毕。"
X03_M03_120_010="[{i HQ}]: 他们将不会忘记那场败仗。干得好，指挥官。总部通话完毕。"
X03_M03_124_010="[{i HQ}]: 柏克公主仍然处于危险。你必须解决瑟拉芬。"
X03_M03_125_010="[{i HQ}]: 要等到瑟拉芬不再是威胁，我们才能把柏克公主救出那里。"
X03_M03_130_010="[{i Princess}]: 他变弱了，指挥官。"
X03_M03_140_010="[{i Princess}]: 北方的瑟拉芬承受极大的损失！持续进攻！"
X03_M03_150_010="[{i Princess}]: 赶快，指挥官，北方的瑟拉芬几乎被打败了！"
X03_M03_160_010="[{i Princess}]: 北方的瑟拉芬已经战败。干得好，指挥官。"
X03_M03_170_010="[{i Princess}]: 西方的瑟拉芬损失大量的基础建设。别给他时间恢复！"
X03_M03_180_010="[{i Princess}]: 西方的瑟拉芬无法承受更多损失！持续你的攻击！"
X03_M03_190_010="[{i Princess}]: 赶快，西方的瑟拉芬就快被打败了！"
X03_M03_200_010="[{i Princess}]: 没关系，我们改天会击败那个瑟拉芬指挥官。"
X03_M03_201_010="[{i Princess}]: 我的宫殿正受到损坏！"
X03_M03_202_010="[{i Princess}]: 我的宫殿无法承受更多损坏！"
X03_M03_203_010="[{i Princess}]: 赶快，指挥官，我的防御正在变弱！"
X03_M03_204_010="[{i Princess}]: 你必须赶快，指挥官！我的防御很快将瓦解！"
X03_M03_210_010="[{i Fletcher}]: 你南方的瑟拉芬拥有核武发射器。它的防御薄弱，所以你应该能轻易占领它。你永远不知道什么时候必须用核武攻击一名外星人…或是其中一个我们所谓的盟友。"
X03_M03_215_010="[{i Fletcher}]: 可能的话，夺取那个发射器，上校。弗莱彻通话完毕。"
X03_M03_220_010="[{i Fletcher}]: 核武发射器是你的了。使用它吧。弗莱彻通话完毕。"
X03_M03_230_010="[{i Fletcher}]: 那真是错失一次该死的机会，上校。弗莱彻通话完毕。"
X03_M03_235_010="[{i Rhiza}]: 我承受太大的损坏，我必须撤退。指挥官，在没有我的情况下请继续战斗。"
