X04_B01_001_010="我们接获报告有两名瑟拉芬指挥官已经登陆「黑底斯」行星。我预料他们正计划发动一场主要攻势而且第一步就要巩固「黑底斯」。我们希望先发制人，所以你和多斯提亚将小小拜访他们一下。"
X04_B01_002_010="过去三年，关于瑟拉芬的一举一动我们连一丁点情报也收集不到，而现在我们却握有这项情资？我突然觉得这真是太便利了。"
X04_B01_002_020="这项情报出自隐藏在瑟拉芬控制空域的塞布兰沈睡监狱。你是说我们不应该相信他们？"
X04_B01_002_030="我几乎不相信任何人，尤其根据最近事件来看。不过一名塞布兰人绝对不会背叛她的兄弟和姊妹，特别是在这种非常时期。"
X04_B01_002_040="我们所知道的只是两名瑟拉芬指挥官已经开始建造量子网关。即使这项情报可疑，我们不能冒险让瑟拉芬完成那些网关。如果它们上线，他们将能对任何星系发动攻击。而我们不能冒此风险。"
X04_B01_002_050="作战很简单：找出并摧毁在这个行星运作的瑟拉芬指挥官。布雷克曼已经完成他的翻译机工作─我们说话的同时，它正上传到你的ACU。"
X04_B01_003_010="一有机会我们将提供额外的情报。祝好运。"
X04_DB01_010_010="[{i Brackman}]: 我钟爱的多斯提亚死了，被我们自己人杀死。我说不出话来，我的孩子，说不出话来。我们即将获得胜利，然而那些我们了解和爱的人却情愿背叛我们。我们必须处理QAI。噢是的。还有Hex5。有些罪行是无可饶恕的。你晓得该怎么做。"
X04_DB01_010_020="[{i Brackman}]: 可怜的多斯提亚。她的腔调害死了她，噢是的。我警告她不要装俄国人，不过她就是不听。就是不听。"
X04_DB01_020_010="[{i Brackman}]: 瑟拉芬势不可挡，噢是的。我们剩下的人如此少。如此少。我应该躲藏，伺机而动。没有其他办法。没有其它选择。"
X04_M01_010_010="[{i HQ}]: 两位指挥官已经登陆行星，作战开始。总部通话完毕。"
X04_M01_012_010="[{i HQ}]: 技术人员做了新的玩具给你─「狗舍」。这是一种自动维修设施，能够自动维修或是协助它操作范围内所有东西。好好享受。总部通话完毕。"
X04_M01_013_010="[{i HQ}]: 布雷克曼做了新的玩具给你─「蜂巢」。这是一种自动维修设施，能够自动维修或是协助它操作范围内所有东西。好好享受。总部通话完毕。"
X04_M01_020_010="[{i Dostya}]: 我侦测到我位置北方大约两公里处有一座敌人基地。我将建造一座基地并且尽快展开攻击。多斯提亚通话完毕。"
X04_M01_020_020="[{i HQ}]: 了解。指挥官，我们发现你的西方有一处敌人阵地。把它清除。总部通话完毕。"
X04_M01_020_030="[{i Dostya}]: 我开始攻击了。抵抗很少，而且我尚未侦测到敌方ACU。总部，你在这个防区有侦测到任何东西吗？"
X04_M01_020_040="[{i HQ}]: 没有。观测器没有反应。总部通话完毕。"
X04_M01_020_050="[{i Dostya}]: 保持警戒，总部。我不希望被突然袭击。"
X04_M01_020_060="[{i HQ}]: 看起来我没有更好的事情可做。总部通话完毕。"
X04_M01_025_010="[{i Dostya}]: 指挥官，我有一些「砖块」待命中。使用命令信号控制它们。多斯提亚通话完毕。"
X04_M01_027_010="[{i Dostya}]: 总部，我已经完成我的任务目标并且开始强化我的阵地。多斯提亚通话完毕。"
X04_M01_027_020="[{i HQ}]: 了解。总部通话完毕。"
X04_M01_030_010="[{i Dostya}]: 尽快完成你的任务目标，指挥官。多斯提亚通话完毕。"
X04_M01_040_010="[{i Dostya}]: 尽快结束你的任务目标，指挥官。多斯提亚通话完毕。"
X04_M01_050_010="[{i HQ}]: 所有作战目标已经达成。开始准备撤回。我们准备带你们离开。总部通话完毕。"
X04_M01_050_020="[{i Dostya}]: 我这里发生状况…撤回命令自动失效。总部，你能确认吗？请对返回的网关进行诊断。总部，请回答。"
X04_M01_050_030="[{i Dostya}]: 指挥官，我们和联盟指挥部失去所有通讯，而且我们无法撤退。等等…我侦测到你西方有什么东西。似乎是个干扰阵列，这一定是封锁我们通讯的东西。找出并摧毁那个干扰设备。多斯提亚通话完毕。"
X04_M01_OBJ_010_010="摧毁瑟拉芬基地"
X04_M01_OBJ_010_020="摧毁量子网关和其它标示的建筑物。"
X04_M01_OBJ_010_030="「砖块」攻击"
X04_M01_OBJ_010_040="盟友空击"
X04_M02_010_010="[{i Dostya}]: 指挥官，额外的干扰设备正扰乱量子力场并且阻止我们撤退或是得到支持。继续维持目标并摧毁封锁我们通讯的阵列。一旦摧毁它，总部就知道如何抵销量子扭曲。多斯提亚通话完毕。"
X04_M02_010_020="[{i Dostya}]: 一架瑟拉芬侦察机刚刚飞越我的基地，所以他们知道了我的位置。不久他们就会发动攻击。"
X04_M02_020_010="[{i Dostya}]: 我看见那个设备了。不可能…它起来像布雷克曼博士开发的原型设备。摧毁它。我们必须和总部联系。多斯提亚通话完毕。"
X04_M02_030_010="[{i Dostya}]: 摧毁那个干扰器！我们必须重新与联盟指挥总部联系！"
X04_M02_040_010="[{i Dostya}]: 你必须摧毁那个干扰器！赶快！我担心瑟拉芬随时都会发动攻击！"
X04_M02_045_010="[{i Dostya}]: 我有一支空军中队待命攻击，指挥官。如果你给我攻击标的，我将派出它们。"
X04_M02_046_010="[{i Dostya}]: 我有一架「死神」待命攻击，指挥官。如果你给我攻击标的，我将派它协助你。"
X04_M02_047_010="[{i Dostya}]: 我有好几架「死神」待命攻击，指挥官。如果你给我攻击标的，我将派它们协助你。"
X04_M02_048_010="[{i Dostya}]: 我受到猛烈攻击，必须撤回我的空军部队。持续攻击，指挥官。摧毁那个干扰器是我们唯一的希望！"
X04_M02_050_010="[{i Dostya}]: 那个设备已经被摧毁了！多斯提亚呼叫总部，回答！"
X04_M02_050_020="[{i HQ}]: 至少有两处量子活动，你们必须…"
X04_M02_050_030="[{i Dostya}]: 听我说！瑟拉芬有种阻止我们撤回的干扰设备。它位于我们行动区域之外，所以你必须找出反制措施。"
X04_M02_050_040="[{i HQ}]: 做好准备，我们将尽快带你们离开那里。"
X04_M02_050_050="[{i Dostya}]: 通知赫尔将军联盟已经被泄秘了。其中一个干扰器是基于布雷克曼创作的原型；没有其它人知道它。毫无疑问我们之中有个叛徒在搞鬼。"
X04_M02_050_060="[{i Dostya}]: 我接触到…好几百个敌方单位正朝我的位置降下。把我们带离这里，总部！"
X04_M02_OBJ_010_010="摧毁量子干扰器"
X04_M02_OBJ_010_020="摧毁或使干扰器失去作用以便能与总部重新建立通讯。"
X04_M03_010_010="[{i Dostya}]: 指挥官，准备好你的防御工事！我会拖延他们。"
X04_M03_010_020="[{i HQ}]: 精英指挥官，你的状况如何？"
X04_M03_010_030="[{i Dostya}]: 他们对我全面进攻…我的防御正在瓦解。我看见一架ACU，不过它不是瑟拉芬。是塞布兰人…"
X04_M03_010_040="[{i Hex5}]: 你这个笨蛋居然和主人对抗，多斯提亚。此刻你将为你的傲慢无礼付出代价。"
X04_M03_010_050="[{i Dostya}]: Hex5！我早该知道如果有任何人背叛我们钟爱的父亲，那一定是你。"
X04_M03_010_060="[{i Hex5}]: 而此刻你应该为你的侮辱付出代价。再见，多斯提亚。"
X04_M03_010_070="[{i Dostya}]: 被围攻…它们太多了…太多了…"
X04_M03_010_080="[{i HQ}]: 精英指挥官！请回答！你听得到我吗？"
X04_M03_020_010="[{i HQ}]: 指挥官，敌人的部队仍然朝你的位置移动。守住阵线直到我们撤离你为止。总部通话完毕。"
X04_M03_020_020="[{i OumEoshi}]: 伟大的指挥官多斯提亚已经阵亡。你是下一个。"
X04_M03_020_030="[{i HQ}]: 看来你解决了首波攻击，不过我们仍然试图想办法反制他们的干扰。撑着点。总部通话完毕。"
X04_M03_030_010="[{i Rhiza}]: 日复一日，我的愤怒越发猛烈。活着回来，勇士，这样我们才能为多斯提亚的死复仇并且一劳永逸消灭瑟拉芬。理萨通话完毕。"
X04_M03_040_010="[{i Hall}]: 尽一切办法活下来，指挥官。我们也无法承受失去你。赫尔通话完毕。"
X04_M03_050_010="[{i Brackman}]: 不…多斯提亚…我钟爱的多斯提亚啊…"
X04_M03_055_010="[{i OumEoshi}]: 只有现在你们才了解情况的无助感。我们知道你们所知道的，我们看见你们所看见的。没有办法能阻止我们。"
X04_M03_056_010="[{i HQ}]: 理萨已经请求我们上传「救赎」火炮。这是一种速射系统，以小型炮弹对一区域进行地毯式轰炸。总部通话完毕。"
X04_M03_057_010="[{i OumEoshi}]: 人类的时代到了尽头。你们将受到亡族灭种的判决。"
X04_M03_060_010="[{i HQ}]: 技术人员已经完成重新校正网关能量核心，不过还需要一会儿才能带你离开那个该死的地方。活下去。总部通话完毕。"
X04_M03_070_010="[{i HQ}]: 还要再久一点，指挥官。总部通话完毕。"
X04_M03_080_010="[{i HQ}]: 网关锁定了黑底斯。只要再几分钟。总部通话完毕。"
X04_M03_090_010="[{i OumEoshi}]: 你的下场将与莱理和克拉克一样。再见，上校。"
X04_M03_100_010="[{i Kael}]: 在同一天失去你和精英指挥官多斯提亚？这已经超过布雷克曼所能承受的。"
X04_M03_110_010="[{i OumEoshi}]: 看着公主的勇士死去使我充满无限的喜悦。"
X04_M03_120_010="[{i HQ}]: 抓紧你的呕吐袋，指挥官，这会很难受。即刻撤回！"
X04_M03_130_010="[{i Brackman}]: 我钟爱的多斯提亚，她必须回家，我的孩子。必须回家。请找出并回收她的遗体。我不能把她留在那里。"
X04_M03_140_010="[{i Brackman}]: 指挥官，请回收伊瓦娜的遗体。"
X04_M03_150_010="[{i Brackman}]: 我们不能抛下伊瓦娜在那个星球上，指挥官。找到她。带她回家。"
X04_M03_160_010="[{i Brackman}]: 谢谢你，我的孩子。谢谢你。"
X04_M03_170_010="[{i Rhiza}]: 勇士，忠诚者已经获得少数瑟拉芬安全密码。如果你能占领一座瑟拉芬雷达，我们便能使用密码占领好几个瑟拉芬防御建筑物。你自行判断攻击雷达。理萨通话完毕。"
X04_M03_175_010="[{i Rhiza}]: 勇士，忠诚者已经获得少数瑟拉芬安全密码。如果你能占领一座瑟拉芬雷达，便能使用密码造成一些瑟拉芬防御措施自爆。你自行判断占领雷达。理萨通话完毕。"
X04_M03_180_010="[{i Rhiza}]: 可能的话占领一座雷达，勇士。理萨通话完毕。"
X04_M03_190_010="[{i Rhiza}]: 占领一座雷达将有助于减轻一些攻击，勇士。理萨通话完毕。"
X04_M03_200_010="[{i Rhiza}]: 太棒了！趁着他们的防御陷入混乱时攻击。理萨通话完毕。"
X04_M03_OBJ_010_010="存活至撤回为止"
X04_M03_OBJ_010_020="待在你的进入地点以便总部能锁定你的位置并且撤回你的ACU。"
X04_M03_OBJ_010_030="回收多斯提亚的ACU"
X04_M03_OBJ_010_040="回收精英指挥官多斯提亚的ACU残骸。布雷克曼博士希望让它们适当地留在在塞布兰国内。"
X04_M03_OBJ_010_050="占领瑟拉芬雷达"
X04_M03_OBJ_010_060="占领其中一座标示的瑟拉芬雷达设施。这能让你撤除瑟拉芬的防御。"
X04_T01_001_010="[{i OumEoshi}]: 你的实验性单位确实令人棘手。它将在完成前被摧毁。"
X04_T01_002_010="[{i OumEoshi}]: 我佩服你的顽强，不过我不会允许你完成那个实验性单位。"
X04_T01_003_010="[{i OumEoshi}]: 你的末日无庸置疑，然而我无法允许你完成那个实验性单位。"
X04_T01_010_010="[{i OumEoshi}]: 你们的银河系很快会是我们的。"
X04_T01_020_010="[{i OumEoshi}]: 只有一个种族能达到完美。"
X04_T01_030_010="[{i OumEoshi}]: 别烦恼。能死在我手下是至高无上的荣耀。"
X04_T01_040_010="[{i OumEoshi}]: 很快地我们将有更多人到来，比你们希望所能打败的数量还多。"
X04_T01_050_010="[{i Hex5}]: 我从不忘记小事，不论有多么小。那正是多斯提亚付出终极代价的原因。"
X04_T01_060_010="[{i Hex5}]: 主人掌控所有它看见的事物。它是无穷无尽的。"
X04_T01_070_010="[{i Hex5}]: 很快地主人将控制所有塞布兰人，他们将在它面前屈服。"
X05_B01_001_010="瑟拉芬最初用来横越进入我们银河系的量子裂缝并不稳定，这使得他们无法召唤援军。然而，我们已经得知为了稳定裂缝，他们正在建造一道量子拱门。当这道拱门完成，瑟拉芬将能够唤来无尽的援军。"
X05_B01_001_020="我们不能允许那件事发生。"
X05_B01_002_010="我们已经开始对「七手节点」进行搜查，取得任何可能有用的情报。在一次搜查中，我们得知QAI的主机位于珍珠二号星。"
X05_B01_002_020="必须将QAI摧毁，我的孩子，必须摧毁。我将伴随你前往珍珠2号星，亲自将它关掉。噢是的。我们接着应该使用它的传送密码绕过其它星系，直接传送回地球。"
X05_B01_002_030="这是我们在拱门运作前唯一摧毁它的机会。如果我们不能取得这些密码，我们就没有希望到达地球。周围星系的防御太严密了。"
X05_B01_002_040="QAI是令人厌恶的东西。我创造它是个错误。太错特错。噢是的。太多错误必须克服。不过这是一个我能修正的错误。一个我愿意修正的错误。不计任何代价。"
X05_B01_002_050="指挥官，你将传送进入并且建立一处滩头阵地。一旦该区安全无虞，弗莱彻准将将加入你，接着布雷克曼博士也会随之过去。"
X05_B01_002_060="我们很快会再见面，我的孩子。很快再见。"
X05_DB01_010_010="[{i Brackman}]: 摧毁QAI之前，我设法得到它的传送密码。前往地球的路清空了。噢是的。我祈祷这场入侵行动会成功。这是我们一笔勾消重新开始的唯一方法。你必须获胜，我的孩子，为我们所有人获得胜利。"
X05_DB01_020_010="[{i Hall}]: QAI毫无疑问在遍及多个星系自我复制，而且瑟拉芬拱门可能已经接近完成。我正下达命令进行大规模撤退。除了躲藏我们别无选择。"
X05_M01_010_010="[{i HQ}]: 你的第一个目标是肃清这个区域的敌人好让利弗莱彻传送进入并且建造一座基地。"
X05_M01_010_020="[{i Hex5}]: 关于多斯提亚真的太遗憾了。主人觉得她是个可造之才。她本来可以成为一名很好的信徒。"
X05_M01_010_030="[{i Brackman}]: 过去我对你百般容忍，Hex5，原谅你的古怪行为。噢是的。不过再也不会了。今天你将为你罪行受到惩罚。"
X05_M01_010_040="[{i Hex5}]: 你是个愚蠢的老头。主人的力量超过你能想象。"
X05_M01_010_050="[{i Brackman}]: 我们就瞧瞧吧。噢是的。我们走着瞧。"
X05_M01_020_010="[{i HQ}]: 肃清此区域，指挥官。弗莱彻整装待发，并且准备好传送。总部通话完毕。"
X05_M01_030_010="[{i HQ}]: 弗莱彻准备好传送，指挥官。等着你肃清该区。总部通话完毕。"
X05_M01_040_010="[{i Fletcher}]: 我已经登陆并且准备作战，上校。让我们拔掉那个该死电脑的插头然后回家。弗莱彻通话完毕。"
X05_M01_050_010="[{i Fletcher}]: 也该是时候了，指挥官。我开始以为你和QAI正在建筑爱的小巢咧。"
X05_M01_060_010="[{i Fletcher}]: 你可以慢慢来没关系。QAI不会自杀，你知道。"
X05_M01_070_010="[{i HQ}]: Hex5在峡谷有几个小型基地。摧毁它们。总部通话完毕。"
X05_M01_080_010="[{i HQ}]: Hex5的基地仍然是威胁。总部通话完毕。"
X05_M01_090_010="[{i HQ}]: 摧毁Hex5的小型基地。总部通话完毕。"
X05_M01_100_010="[{i HQ}]: Hex5的次要基地已经摧毁。总部通话完毕。"
X05_M01_110_010="[{i Fletcher}]: 这整件该死的事情一团糟。塞布兰人相互敌对？万古只因为某个公主出现就改变阵营？我告诉你，我们不能信任他们任何人。UEF的战斗，那才是要紧的事。那是才是唯一要紧的事。弗莱彻通话完毕。"
X05_M01_120_010="[{i Brackman}]: 这场战争有太多是我的错。噢是的。忠诚程序、QAI。做出了愚蠢的选择，愚蠢的选择。该是改错归正的时候了。把它们矫正。要平安，我的孩子。"
X05_M01_130_010="[{i Rhiza}]: 凯尔实施极端的手段。她已经把整座城市移平，杀死数百万人。内战在遍及万古控制的星域蔓延。教团没有办法能够幸存下来。理萨通话完毕。"
X05_M01_140_010="[{i Rhiza}]: 一位名叫雅玛丽亚的忠诚者被囚禁在你东方的监狱，位置已经标示出来进行占领。占领这座监狱并且救出雅玛丽亚。理萨通话完毕。"
X05_M01_150_010="[{i Rhiza}]: 雅玛丽亚仍然被关着。可能的话救出她。理萨通话完毕。"
