X05_M03_OBJ_010_010="保护布雷克曼博士"
X05_M03_OBJ_010_020="布雷克曼博士已经来到珍珠二号星要亲自摧毁QAI。你必须不计任何代价保护他的「巨石」。"
X05_M03_OBJ_010_030="护送布雷克曼博士到达主机。"
X05_M03_OBJ_010_040="布雷克曼博士必须到达QAI主机以便摧毁它。帮他清空道路并且使用「命令信号」指出他应该前往的地方。「命令信号」必要时会更新。"
