X05_M03_OBJ_010_070="占领科学建筑物"
X05_M03_OBJ_010_080="雅玛丽亚已经指出如果你占领标示的科学建筑物，你将取得它旁边的「银河巨像」控制权。然而，如果你不及时占领它，教团科学家最后将发现并且消灭她的病毒，并且「银河巨像」将受到他们的控制。"
X05_M03_OBJ_010_090="摧毁QAI"
X05_M03_OBJ_010_100="带布雷克曼博士到主机处以便他能一劳永逸铲除QAI。"
