X05_T01_130_010="[{i Hex5}]: 在这一天，我们将摧毁两位联盟中最受钟爱的指挥官。"
X05_T01_140_010="[{i Hex5}]: 主人会为那件事惩罚你。"
X05_T01_150_010="[{i Hex5}]: 你既软弱又愚笨，惧怕你不了解的事物。"
X05_T01_160_010="[{i Hex5}]: 对抗主人你毫无机会。我会摧毁你。"
X05_T01_170_010="[{i Hex5}]: 布雷克曼博士的忠诚程式奴役亿万人。那是他的耻辱。"
X05_T01_180_010="[{i Hex5}]: 看见多斯提亚死让我兴奋。你将加入她。"
X05_T01_190_010="[{i Hex5}]: 你将屈服于瑟拉芬。"
