X05_T01_220_010="[{i Hex5}]: 即使你摧毁我，主人会继续活下去。"
X05_T01_230_010="[{i Hex5}]: 等等！主人！"
X06_B01_001_010="必须保持这件事简短且愉快，指挥官。瑟拉芬正加紧完成他们的拱门，因此我们必须阻止这件事发生。随着QAI的摧毁和「教团」陷入无政府状态，这是发动攻击的机会。"
X06_B01_001_020="这个任务很简单：你将前往地球并且摧毁拱门。弗莱彻和理萨会先传送过去清除你降落区周边区域。你一登陆，立刻建造你的武力并且攻击。"
X06_B01_001_030="然而，拱门的摧毁并不代表瑟拉芬的威胁结束。裂缝必须加以封闭。一旦摧毁拱门，我将前往地球并进入裂缝。一进去，我会永远把它关闭。"
X06_B01_001_040="我们没办法得知裂缝另一边的瑟拉芬发生什么事。若是他们也在那边建造一道拱门又怎么样？我们不能冒此风险。我们时间有限。"
X06_B01_001_045="没有理由让你这么做，柏克公主。我们已经让技术人员研究解决之道。他们只需要更多一点时间。"
X06_B01_001_060="我们没办法得知裂缝另一边的瑟拉芬发生什么事。若是他们也在那边建造一道拱门又怎么样？我们不能冒此风险。我们时间有限。"
X06_B01_001_070="你从躲藏中现身时看看发生什么事。如果你死了，你觉得又将发生什么事？情况只会变得越来越糟。"
X06_B01_001_080="瑟拉芬是我们最大的威胁。没有他们，凯尔就什么也不是。她很轻易就能击败。不过只要裂缝还存在，瑟拉芬便是危险。必须把它关闭。"
X06_B01_001_090="指挥官，你有你的命令。准备立即传送。"
X06_DB01_010_010="[{i Hall}]: 裂缝封闭了，而且教团逃走了。很遗憾没有柏克公主的任何迹象，不过我们会持续搜寻。"
X06_DB01_020_010="[{i Hall}]: 瑟拉芬以惊人的速率通过裂缝涌来。没办法阻止他们。我们完了。"
