X06_M01_065_010="[{i Rhiza}]: 勇士，弗莱彻和我很快将前往对抗瑟拉芬。征服你区域的敌人基地并且加入我们的攻击。理萨通话完毕。"
X06_M01_070_010="[{i Hall}]: 留意弗莱彻，上校。我别无选择只能派他参与这次行动，而我们承受不起任何差错。一有麻烦我们会立刻把他撤回。赫尔通话完毕。"
X06_M01_080_010="[{i Brackman}]: 我们长久的奋斗即将结束，我的孩子。噢是的。要安全。"
X06_M01_090_010="[{i Rhiza}]: 凯尔变得越来越绝望，而教团已经陷入混乱。理萨通话完毕。"
X06_M01_100_010="[{i Rhiza}]: 我们的攻击开始。荣耀归于公主！"
