X06_M02_010_010="[{i HQ}]: 一名瑟拉芬指挥官正阻挡你前往拱门的路。击败那个异形的部队然后往拱门移动。总部通话完毕。"
X06_M02_010_020="[{i Rhiza}]: 弗莱彻准将，瑟拉芬正从四面八方攻击我。我需要协助！你在哪里？"
X06_M02_010_030="[{i Fletcher}]: 我为何要帮助你？你和其它人没什么两样。这场战争结束，你将会背叛我们。"
X06_M02_010_040="[{i Hall}]: 弗莱彻准将！你有你的命令！你必须协助圣战士理萨。"
X06_M02_010_050="[{i Fletcher}]: 你出卖我们，赫尔。与怪物和怪胎结盟。一旦我弄到「黑日」，我将重建它并且一劳永逸结束这场战争。"
X06_M02_010_060="[{i Hall}]: 你在说什么该死的东西？「黑日」早就被摧毁了。万古和塞布兰现在是我们的盟友。"
X06_M02_010_070="[{i Fletcher}]: 你这个笨蛋。他们在你的眼皮底下耍阴谋诡计，而你居然浑然不知。"
X06_M02_010_080="[{i Hall}]: 总部，撤回弗莱彻。我要他离开那里！"
X06_M02_010_090="[{i HQ}]: 他的撤回信标没有作用。我们从这端无能为力。"
X06_M02_010_100="[{i Fletcher}]: 我花了很多时间思考这件事。只有一个可能的结果。一个结束这场战争的方法。"
X06_M02_010_110="[{i HQ}]: 看来傻瓜终于疯了，指挥官。弗莱彻正朝残留的「黑日」控制中心前去。总部通话完毕。"
X06_M02_020_010="[{i Hall}]: 上校，消灭弗莱彻准将。他的行为危及整个行动。"
X06_M02_020_020="[{i Rhiza}]: 我正在和教团指挥官交战，不过可能的话我会协助！理萨通话完毕。"
X06_M02_030_010="[{i Brackman}]: 我的孩子，赫尔将军授权你阻止弗莱彻准将。使用任何必要手段。绝对不能让他妨碍我们的计划。"
X06_M02_030_020="[{i Rhiza}]: 博士，我将尽可能协助你，不过我目前正与瑟拉芬战斗。理萨通话完毕。"
X06_M02_040_010="[{i Princess}]: 勇士，UEF已经和弗莱彻断绝关系。处理掉他。"
X06_M02_040_020="[{i Rhiza}]: 勇士，我正与瑟拉芬战斗，不过可能的话我会协助你。理萨通话完毕。"
X06_M02_050_010="[{i HQ}]: 教团部队正移动到你的南方，而那个疯子弗莱彻正准备一场攻击。处理他们两个。总部通话完毕。"
X06_M02_060_010="[{i HQ}]: 我们发现维狄塔的基地有一座「钻石」。如果你摧毁它就能瘫痪她的经济。总部通话完毕。"
X06_M02_090_010="[{i Hall}]: 指挥官，必须阻止弗莱彻准将。这场任务不能被破坏！赫尔通话完毕。"
