X06_M02_110_010="[{i Hall}]: 你没有其它选择，指挥官。弗莱彻的行为逼你下手。继续作战行动。赫尔通话完毕。"
X06_M02_120_010="[{i Hall}]: 指挥官，尽快击败教团指挥官！赫尔通话完毕。"
X06_M02_130_100="[{i HQ}]: 瑟拉芬指挥官挡在你和拱门之间。击败那个瑟拉芬指挥官然后攻击拱门。总部通话完毕。"
X06_M02_140_010="[{i HQ}]: 那收拾掉教团指挥官了。总部通话完毕。"
X06_M02_150_010="[{i HQ}]: 刚刚获得关于「黑日」控制中心的更新数据。它与以前的「零号状况」防御网络联机，而且看起来这些武器有些仍然上线。不管是谁占领控制中心都能使用联机的武器系统。占领控制中心。总部通话完毕。"
