X06_M02_240_010="[{i HQ}]: 拱门就在那里！摧毁它！"
X06_M02_240_020="[{i Kael}]: 你们太迟了，笨蛋！拱门完成了！瑟拉芬已经大量通过它。他们将净化整个银河系。"
