X06_M03_057_010="[{i HQ}]: 拱门快垮了。它差不多要被摧毁了。"
X06_M03_060_010="[{i Princess}]: 局势对你不利，凯尔。"
X06_M03_060_020="[{i Kael}]: 想点办法！"
X06_M03_060_030="[{i SethIavow}]: 你这个可悲的人类。你真的相信我们为你服务吗？你只不过是达成死亡的手段。当我们完成时，银河系中每个人类都得死。"
