X1CA_001_description="位于葛理芬四号星的克拉克要塞是UEF仅存的堡垒。瑟拉芬和教团部队正以压倒性的武力攻击这座要塞。如果克拉克要塞陷落，UEF也将随之灭亡。你将击败葛理芬四号星上的敌方指挥官并且结束对克拉克要塞的围攻。"
X1CA_002_description="由圣战士领导的万古「忠诚者」在执行针对「教团」和QAI阵地的破坏及情报任务时被俘虏。你必须拯救这些被QAI囚禁的「忠诚者」并且击败所有在此星球上活动的敌方指挥官。"
X1CA_003_description="公主回归了！不过她正面临极大的危险。瑟拉芬部队已经把她困在「蓝天」行星上，而且她已经没有机会逃脱。你将前往「蓝天」，消灭瑟拉芬指挥官并且拯救柏克公主。"
X1CA_004_description="联盟接获一项未证实的情报：瑟拉芬大军正在「黑底斯」行星上集结─控制「黑底斯」将可让瑟拉芬攻击联盟控制的宙域内任何位置。精英指挥官多斯提亚将在这场任务加入你，而你们两人必须歼灭「黑底斯」上所有瑟拉芬部队。"
X1CA_005_description="由于「黑底斯」上发生的事件，必须一劳永逸地消灭QAI。使用从「七手节点」获得的情报，联盟已经得知QAI的大型主机位于「珍珠」二号星上。你的任务是在「珍珠」二号星建立据点，从而为布雷克曼博士肃清道路，他将亲自前往关闭QAI。"
X1CA_006_description="使用从QAI残骸回收的闸门密码，联盟现在能直接传送至地球，瑟拉芬正在那里战造一道量子拱门。一旦完成，这道拱门将使瑟拉芬招来无限的援军。必须不惜一切代价摧毁这道拱门。"
