Unit_Description_0307="移动缓慢的重型装甲攻击机器人。设计来进攻基地防御措施和建筑物。"
Unit_Description_0308="藉由升级基础「煎饼」架构并且以拆卸下来的「阿罗哈」战术导弹发射器安装，UEF研究人员创造出「矛头」，一种射速缓慢但威力强大的机动导弹发射平台。"
Unit_Description_0309="重型运输机。配备28具运输钩、重型加农炮、导弹发射器，以及护盾产生器。能够运载多达28个单位。"
Unit_Description_0310="「桶匠」是一种轻型快艇，配备单门「琵琶鱼」鱼雷管和一具反鱼雷炸弹发射器。尽管易受损坏，但一小群「桶匠」能消灭同等数量更昂贵的潜水艇。"
Unit_Description_0311="「防波堤」是一种相对便宜的船舰，能够用它的护盾产生器保护邻近船只，在战斗中延长它们的使用期限并且能让它们对目标发射更多弹药。"
Unit_Description_0312="高档反舰船舰。装备等离子光束、鱼雷系统、反导弹防御以及反鱼雷爆弹。"
Unit_Description_0313="突出一门重型等离子格林加农炮，「劫掠者」能对单一目标造成极大的破坏。它厚重的外部装甲也能在失效前承受惊人的打击。"
Unit_Description_0314="「诺瓦司中心」发射并控制诺瓦司卫星。这些卫星在防空武器的射程之外缓慢地飞越大气层上空，使用它们的光束武器摧毁敌人单位和建筑物。"
Unit_Description_0315="为了在激烈战斗中使用，「火花」是一种装甲强化的T2工程师，它配备一挺机炮而且一套完整的雷达和干扰器来帮助延长它的战斗寿命。"
Unit_Description_0316="「狗舍」是一种自主性建造单位，它能部署三架「流浪者」工程机器人，依照命令来维修、开采、协助以及占领任何它运作半径内的任何单位。"
Unit_Description_0317="「火甲虫」机动炸弹装甲轻薄而且没有武器，不过一旦靠近目标时能加以引爆。如果这个单位被摧毁，完整的安全机制能避免它全面爆炸。"
Unit_Description_0318="具两栖能力的「砖块」是「勤王者」的升级版本，以更厚的装甲和强大的武器为特色。它装备的武器包含一具重型分解脉冲激光、一具纳奈鱼雷发射器以及反鱼雷信号弹。"
Unit_Description_0319="巨大实验性机器人。装备双管质子加农炮、防空防御、鱼雷发射器以及反鱼雷诱导弹。投下的「蛋」可以被转换成单一单位。"
Unit_Description_0320="「小丑」武装良好而且速度极快，它能快速、有效地拦截并摧毁大群轻型单位。然而，「小丑」只有轻型装甲而且射击距离有限。"
Unit_Description_0321="「尖啸者」是塞布兰版本的「阔剑」。UEF装备武器被纳奈导弹和分解脉冲激光取代，而且还加装一组雷达干扰器套件。"
Unit_Description_0322="「梭鱼」拥有三门纳奈鱼雷管和反鱼雷信号弹，它能交战并且击败大多数敌人船舰。它也包含了一套「个人声纳匿踪」力场，使得它无法被声纳侦测。"
Unit_Description_0323="「美人鱼」配备一套声纳和雷达匿踪力场，能让它和任何在它力场范围下的船只不被侦测的通过敌人雷达和声纳区。反鱼雷信号弹提供保护免于潜艇的危害。"
Unit_Description_0324="蜂巢是一种自主性建造单位，它能部署四架迷你建造机器人，依照命令来维修、开采、协助以及占领任何它运作半径内的任何单位。"
Unit_Description_0325="「汉姆斯」是标准鱼雷防御的升级版，它武装一具「克里尔」鱼雷发射器，使它甚至能消灭最大型的敌人船舰。"
Unit_Description_0326="「预言者」持续不断地产生数以千计的纳米摄影机，能遍布监控一处极大的区域。由于纳米摄影机很快就失去作用，所以「预言者」会不断地补充它们。"
Unit_Description_0327="尽管只有轻型装甲，「火焰」行动快速而且装备两门速射量子机炮。「火焰」设计的用意是击穿敌人的防线并且蹂躏较少防御的后方防区。"
Unit_Description_0328="从改装的「先锋」底盘建造，「幽灵打击者」提供高伤害的准确率和优异的射程。它的主要角色是从远距离消灭像是火炮等高价值的目标。"
Unit_Description_0329="「疾风」的造价比「光冠」还便宜，不过有比「保护者」更佳的速度和火力，它用有优异的缠斗能力并且能填补T1和T3战斗机之间的空缺。"
Unit_Description_0330="为了抵制炮艇的攻击，万古将「修复者」防空炮艇投入使用。缓慢，不过装甲厚实，「修复者」配备四连装轻型激光和「热诚」导弹，使它具备优秀的防空能力。"
Unit_Description_0331="使用经过考验的「祭品」底盘为基础，万古研究开发人员把它加大以容纳更多鱼雷，同时也升级装甲。新的「慰藉」可以发射更多弹药而且能比旧型的「水禽」待在战场上更久。"
Unit_Description_0332="为了反制敌方大群潜艇，万古投入一种专门的潜艇猎人，「晚祷」。装备慢速鱼雷和「类星体」反鱼雷爆弹，「晚祷」能够轻易地消灭敌人潜艇。"
Unit_Description_0333="以两架「蛇纹」战术导弹座为特色，「奔流」提供长距离、精准、防御岸线的完美炮台。"
Unit_Description_0334="「救赎」射速极快，在广阔区域投下炮火。每发射击出去的炮弹会裂成两半，造成轻度的广域破坏，不过它的速射设计使得它能持续攻击目标。"
Unit_Description_0335="「蕾安妮之眼」打开通道进入量子空间然后回到正常空间。结果就是「眼睛」赋予一位万古指挥官在战场上任何地方的视线。"
Unit_Description_0336="可生产几乎无限的能量和质量。切换输出来符合生产需求。如果被摧毁，导致的爆炸等同于战略武器的引爆。"
Unit_Description_0337="「赛伦」是一种轻型、快速的单位，它配备小型雷达和自我防御的轻型武器，当闲置时它会自动地部署隐蔽和匿踪力场，使得它成为一种极为好用的机动雷达。"
Unit_Description_0338="偏好迅速、机动性而且轻型的单位，瑟拉芬设计出「桑姆」中型坦克。武装标准的电磁加农炮，「桑姆」能给予还不错的伤害和射击速度。"
Unit_Description_0339="「组伊」是一种两栖、间接火力支持车辆。它的弹药会释放一种电子浪涌。这种浪涌能产生叉状的闪电，延伸击中任何半径范围内的单位。"
Unit_Description_0340="「拉伊斯特」是基本的战场防空防御，它使用格林类型武器，其弹药只能造成轻度伤害，不过一连串集中的弹药能快速地摧毁大部分低阶敌方飞行单位。"
Unit_Description_0341="配备一双「弗瑞玛电子炮」，「艾尔斯哈弗」能够摧毁同等数量的人类单位。它的轻装甲使得它容易受到火炮和其它间接火力武器的影响。"
Unit_Description_0342="「彦吉尼」的设计虽然老旧，不过它以一种空浮系统和重型相位机炮加以升级而再次成为瑟拉芬主力战争机器。"
Unit_Description_0343="相对移动快速的机动战术导弹发射器。"
Unit_Description_0344="「艾夏弗」是瑟拉芬版本的高射炮。"
Unit_Description_0345="「欧图姆」是一种两栖攻城坦克。它的「索加农炮」射速缓慢，不过能造成很大伤害而且有「艾里奥电子炮」支持。「欧图姆」拥有单管「乌尔」气穴鱼雷对付海军威胁。"
Unit_Description_0346="「乌撒阿」是一种快速单位，能迅速有效地接近目标。一旦到达射击位置，「乌撒阿」可转变成狙击模式。这增进它的命中率、伤害力以及射程，尽管使它的射速降低。"
Unit_Description_0347="机动重型火炮。冲击时可造成中度伤害。"
Unit_Description_0348="瑟拉芬机动护盾产生器可为机动部队提供绝佳的保护。"
Unit_Description_0349="「伊若塔」实际上是两个单位合为一体。在它开始的形态，「伊若塔」配备一门相位激光。一旦被摧毁，它释放出能量生物「欧苏依」，在短暂的时间攻击它附近的单位。"
Unit_Description_0350="「色雷依斯特」，这种标准侦察机的装甲轻薄而且拥有很好的视线范围。它的雷达安装在耐撞击的箱子中，在哨兵坠毁后还能暂时运作一段时间。"
Unit_Description_0351="「拉亚塔」拦击机是一种快速、灵活的战机，它配备一种格林类型武器「赛罗」，能集中发射一串轻型弹药迅速地给予可观的伤害。"
Unit_Description_0352="「辛维」是设计来快速、精准的攻击。这种轰炸机飞行的速度非常的快，不过油量却很小。它很难击中移动中的目标，因为要促进命中率，「炸弹」的速度会放慢。"
Unit_Description_0353="低阶运输机。可运载最多8个单位。"
Unit_Description_0354="「诺塔」是结合截击机和攻击轰炸机的单位，它两种角色都能胜任。它搭载和它母体单位同样的武器。"
Unit_Description_0355="这种炮艇不使用和人类炮艇标准的回避射击模式，不过它的装甲更为厚实。「沃尔图」的四门重型相位机炮架设于它的周边。"
Unit_Description_0356="「乌西欧兹」似乎是直接从万古的「水禽」鱼雷轰炸机衍生出来的。最大的不同在于「乌西欧兹」投射三枚重型气穴鱼雷，赋予它更强的火力。"
Unit_Description_0357="中阶运输机。可运载最多16个单位。"
Unit_Description_0358="「拉塞蓝」有绝佳的光学射程，以及内建的雷达和声纳套装。它是一种快速、灵活的单位而且油量大的单位，允许它进行长期任务。"
Unit_Description_0359="「拉西尼」配备瑟拉芬最有效的防空武器─「罗萨瑞」防空机炮，它非常能胜任对付任何人类建造的制空战斗机。"
Unit_Description_0360="「辛塔」配备一种独特的瑟拉芬武器，「凯马辛」战略炸弹。这种炸弹能造成绝佳的单一目标和区域性伤害。"
Unit_Description_0361="巨大轰炸机，能够毁灭整座基地。配备一枚实验性战略炸弹和三门防空机炮。"
Unit_Description_0362="低阶海军单位。配备一门机炮和防空格林机炮。"
Unit_Description_0363="瑟拉芬在他们的「苏伊斯托」潜艇上包含了一具反鱼雷发射器来补强它的防御。「苏伊斯托」也装备电磁加农炮作为额外的上浮火力。"
Unit_Description_0364="有一对「欧拉里斯」防空加农炮、一具战术导弹发射器和「艾阿图」战术导弹防御，「伊塔鲁亚」以间接火力和防御性能力支持舰队。"
Unit_Description_0365="「攸夏弗」以一种的短程、水面下的光束摧毁来袭的鱼雷。它能发射「阿纳伊特」鱼雷并且也装设「超半音光束产生器」，射出一道光束攻击水面目标。"
Unit_Description_0366="「豪桑姆」装设三门重型「夸能」加农炮，平均分配于船身。此外，「豪桑姆」配备2门防空加农炮、2具战术导弹防御，以及一座战略导弹发射器。"
Unit_Description_0367="专用的潜艇杀手。配备三门鱼雷管、一对鱼雷防御系统和防空机炮以利浮出水面使用。"
Unit_Description_0368="能够容纳、运输以及维修飞行器。配备两对防空机炮。"
Unit_Description_0369="使用双管电磁加农炮，「乌塔尔斯」一种轻装甲炮塔，设计用于低风险遇敌和起始基地防御。「乌塔尔斯」以低廉的造价提供良好的火力。"
Unit_Description_0370="使用和「乌塔尔斯」同样的架构，「依亚拉」以防空炮取代加农炮。虽然对付T1攻击者很有效率，不过「依亚拉」缺乏消灭编队的T2或T3单位。"
Unit_Description_0371="「苏阿塔」提供良好的保护对抗各种船舰，不过缺乏撑过持续轰炸的装甲。它是一种便宜、低等级的海军防御单位。"
Unit_Description_0372="和其它阵营一样，瑟拉芬使用模块化的墙段来保护建筑物，避免意外的入侵者和直接武器攻击。"
Unit_Description_0373="「乌塔尔萨拉」是一种重装甲炮塔，它架设一具「超半音」光束产生器。这赋予「乌塔尔萨拉」绝佳的射程和火力，能让它对付甚至最重型的敌方单位。"
Unit_Description_0374="「辛拿塔」是T1防空防御的升级，它使用较重型的「欧拉里斯」加农炮于前方装甲炮塔以提供瑟拉芬基地优越的防空保护。"
Unit_Description_0375="使用先进的设定目标和追踪计算机，「依利撒塔」能够以单一、准确的射击，击落来袭的导弹。"
Unit_Description_0376="在其半径范围内围绕单位和建筑物产生护盾。"
Unit_Description_0377="反舰防御系统。部署鱼雷防御系统。"
Unit_Description_0378="「拉萨依欧兹」并不发射导弹，而是以能量爆裂球攻击敌方飞行器。这种能量球能追踪它们的目标而且撞击时造成结实的伤害同时也吸收油料。"
Unit_Description_0379="「依利斯欧兹」与瑟拉芬情报网络紧密结合，能让它追踪来袭的导弹并且计算最佳的拦截角度。必须命令「依利斯欧兹」建造自己的导弹。"
Unit_Description_0380="「艾瑟尼」是一种有效率的护盾设计，它能够比其它相较的护盾系统保护更大的区域。它也能在需要充能前承受更大的伤害。"
Unit_Description_0381="「组桑」提供战略等级的火炮支持。「组桑」的弹药可造成直接冲击伤害，不过只有小范围的区域伤害。考虑到这个单位的高射击速度，这是可接受的。"
Unit_Description_0382="「依利斯」比它的类似的人类单位提供更远的射程和伤害潜力，虽然每一枚导弹需要资源建造，如果大量使用它们的话有可能瘫痪经济。"
Unit_Description_0383="「拉图乌提」最多一次能为六架空中单位提供快速加油和维修。在其它方面它的作用则和人类的空中作战平台一样。"
Unit_Description_0384="「吼瓦桑」需要资源来射击，不过以绝佳的命中率、射程和伤害来补偿这个缺点。每发弹药会释放一种能量生物，只要这种生物持续存在，它会攻击任何靠近它的单位。"
Unit_Description_0385="「哈斯图」建造、储存并且发射导弹。每一枚导弹必须资源来建造，不过可造成大范围的广域爆炸，能够摧毁半径范围内几乎任何单位。"
Unit_Description_0386="「攸罗讷欧斯」发射一枚巨大的导弹。每一枚导弹耗费可观的资源建造，而且只能储存一枚，不过这种导弹是如此巨大，它需要两枚防御导弹来击落它。"
Unit_Description_0387="工程师是一种多功能建筑、维修、占领及开采部队。它有两栖功能，可以滑过水面建造海军设施。"
Unit_Description_0388="这是T1工程师的升级版，可以建造更复杂的建筑。它由T2工厂建造。"
Unit_Description_0389="这是T2工程师的升级版，可以建造更复杂的建筑。这是唯一能够建造实验性部队的工程师。它由T3工厂建造。"
Unit_Description_0390="陆军工厂建造作战所必须的基本行动部队。这个工厂只能建造地面部队。它可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0391="空军工厂建造作战所必须的基本空军部队。这个工厂只能建造空中部队。工厂可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0392="海军工厂建造作战所必须的基本海军部队。这个工厂只能建造海上部队。工厂可以升级为T2，而且可以协助其它工厂。"
Unit_Description_0393="这是T1陆军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0394="这是T1空军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0395="这是T1海军工厂的升级。这个总部可以升级为T3总部，拥有总部可以使其他工厂使用更少的资源升级，使工厂能够使用高级的部队设计图。"
Unit_Description_0396="这是T2陆军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0397="这是T2空军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0398="这是T2海军总部的升级。这个总部无法再升级。它可以协助其它工厂。"
Unit_Description_0399="装备最先进的硬设备，「耶兹乌提」能够召唤副指挥官在战场上协助指挥官。"
Unit_Description_0400="「乌亚依亚」是一种廉价、充实而且稳定的能量产生来源。发电机可以连接至其它建筑物，使连接之建筑物的运作费用略为降低。"
Unit_Description_0401="生产能量。必须盖在碳氢矿床上。紧邻碳氢发电厂建造的建筑物可获得加成。"
Unit_Description_0402="能量仓库组件提高指挥官的经济体系中的能量容量上限。建造在发电机旁边以获得加成。"
Unit_Description_0403="汲取质量。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0404="中阶质量制造机。需要大量能量。建造在其它建筑物旁可获得加成。"
Unit_Description_0405="储存质量。建造在汲取机或制造机旁可获得加成。"
Unit_Description_0406="中阶发电机。建造在其它建筑物旁可获得加成。"
Unit_Description_0407="中阶质量汲取机。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0408="T3发电机是最好的前线能量供应来源。将建筑物建立在融合反应炉阵列旁边，会提高其运作效率。"
Unit_Description_0409="高阶质量汲取机。必须建造在质量矿床上。在质量汲取机旁建造建筑物可获得加成。"
Unit_Description_0410="T3质量制造机可以用超高的能量成本生产少得可怜的质量。只有具备极大量能量的基础才能够让这种设施运作。"
Unit_Description_0411="瑟拉芬标准的雷达设施是监视地方上有无未经授权者入侵的有效方法。轻型机种的范围和装甲有限，但是可以升级。"
Unit_Description_0412="瑟拉芬的声纳设施非常类似雷达系统。作为廉价、短程侦测机制，「修」表现得很好。「修」的侦测器套件可以升级。"
Unit_Description_0413="「修艾赛尔」是「修」声纳系统的远程版。「修艾赛尔」能够从「修」版本升级而成。"
Unit_Description_0414="「赛雷艾赛尔」是「艾赛尔」雷达系统的远程版。「赛雷艾赛尔」能够升级成「尔兹艾赛尔」全方位侦测套装。"
Unit_Description_0415="「赛雷依欧兹」以先进雷达干扰域来掩护一片区域。这片干扰域使雷达无法发现在其中的部队，但是对于肉眼没有效果。"
Unit_Description_0416="「尔兹艾赛尔」全方位侦测套装是收集情报的极致手段。除了非常远的有效距离外，它也可以打败匿踪力场和其它的隐蔽技术。"
X01_B01_000_010="7/29/3847"
X01_M02_042_010="[{i Hall}]: 我要那些平民离开那里，上校。治安官葛拉汉正安排一队可用的卡车给你；用它们撤离平民到城市中心。"
X01_M02_042_020="[{i HQ}]: 你必须告诉这些卡车到你希望它们移动的位置。点击你抬头显示器右方，任务提示器下方的「命令信号」钮，然后点击卡车应该前往的位置。总部通话完毕。"
X01_M02_043_010="[{i Graham}]: 避难所暂时安全了，上校，不过我不认为人们可以活过另一场攻击。万一教团指挥官再次袭击我们…"
X01_M02_044_010="[{i Gari}]: 我的扫描显示一群卡车正要出发。不用说，载满了平民。我应该会很乐于猎杀他们。"
X01_M02_161_010="[{i Gari}]: 哈哈哈！"
X01_M02_OBJ_010_070="摧毁教团攻击基地"
X01_M02_OBJ_010_080="摧毁指定的「教团」基地以解除对西普林城镇的围攻。"
X02_B01_000_010="8/1/3847"
X02_M01_151_010="[{i HQ}]: 也许那些忠诚者并非毫无用处。那些发电机是保持赛兰妮主基地护盾运作的设施。摧毁发电机护盾就完了。总部通话完毕。"
X02_M03_012_010="[{i HQ}]: 侦测到多枚战略导弹发射。看来这对情侣正相互用核武攻击。总部通话完毕。"
X02_M03_015_010="[{i Celene}]: QAI的基地位于西北方，而赛兰妮消灭它大部分的导弹发射器。你应该去拜访那个该死的计算机一下。总部通话完毕。"
X02_M03_017_010="[{i HQ}]: 看来QAI正企图从它的瑟拉芬兄弟招来协助。预计一名瑟拉芬指挥官马上会到星球上。总部通话完毕。"
X02_M03_017_020="[{i Brackman}]: 这对我们是个绝佳的机会，我的孩子。噢是的。我一直在进行一种翻译机，一种可以让我们破译瑟拉芬彼此在说什么的装置。"
X02_M03_017_030="[{i Brackman}]: 如果你占领瑟拉芬将使用的量子闸道，我可以上传一种程式，在驾驶员离开网关时把他杀死。噢是的。瑟拉芬的ACU将归你指挥，而我将能够破解它的语言矩阵。"
X02_M03_017_040="[{i HQ}]: 瑟拉芬正经由位于QAI基地北方的网关过来了。占领那个网关。总部通话完毕。"
X03_B01_000_010="8/2/3847"
X03_M02_081_010="[{i HQ}]: 瑟拉芬正准备他的攻击！这是你最后的机会！摧毁那些轰炸机！总部通话完毕。"
X03_M02_082_010="[{i HQ}]: 靠…我真不敢相信。你真的摧毁它们了。"
X03_M03_200_020="[{i HQ}]: 该死，那个滑溜的混蛋传送逃走了。"
X03_M03_200_030="[{i HQ}]: 指挥官，柏克西方的瑟拉芬指挥官拔掉了插头并且传送离开。看起来他的基地正停止运作，所以你不用再担心它。总部通话完毕。"
