AITYPES_0021="一名在攻击单位和科技升级之间平衡的强硬对手。这是SC1中发表的AI。"
AITYPES_0030="旧科技AI"
AITYPES_0031="一名偏好科技升级胜于攻击单位的强硬对手。这是SC1中发表的AI。"
