X01_M01_011_010="[{i HQ}]: 有一排敌方火炮保护基地。它们是机会目标，不过如果你能摧毁它们将有助于你更轻松完成任务。"
X01_M01_012_010="[{i HQ}]: 一旦你处理主基地，我们将更新─啊，该死，敌方炮艇出现。趁我们还可以，是让你下去那里的时候了。"
X01_M01_013_010="[{i HQ}]: 可恶，它们正在攻击闸道。趁你还可以时快登陆星球！"
X01_M01_014_010="[{i HQ}]: 那真是有点叫人不自在。搞定它，指挥官。"
X01_M01_021_010="[{i HQ}]: 我也发现好几个敌方火炮阵地。它们是机会目标，不过如果你能摧毁他们将有助于你更轻松完成任务。"
X01_M01_031_010="[{i Rhiza}]: 我们正给你「疾风」，一种中距离喷射战斗机。理萨通话完毕。"
X01_M01_032_010="[{i Rhiza}]: 指挥官，你已经收到「火花」的设计图。虽然它的装甲薄弱，但配备一些令人印象深刻的火力。理萨通话完毕。"
X01_M02_011_010="[{i Graham}]: 指挥官，教团部队已经铲平我们大部分的防御设施。我们已经从克拉克要塞被切断，而弗莱彻无法派援军过来。我们需要你的协助。"
X01_M02_012_010="[{i Hall}]: 计划改变，指挥官。弗莱彻必须靠自己坚守克拉克要塞久一点─你将保护平民并且消灭该地区任何敌方武力。"
X01_M02_013_010="[{i Gari}]: 我会净化这个星球所有人！与我们的力量对抗愚不可及！"
X01_M02_046_010="[{i Graham}]: 我不敢相信…整座城镇都毁了。"
X01_M02_281_010="[{i HQ}]: 有一具「银河巨像」朝你前去。解决它。总部通话完毕。"
X01_M02_340_010="[{i HQ}]: 看来盖芮正派出迎宾礼车。"
X01_M02_350_010="[{i HQ}]: 假使你活过这场攻击，前往那里并且一劳永逸消灭盖芮。总部通话完毕。"
X01_M02_360_010="[{i HQ}]: 保护城镇，指挥官！总部通话完毕。"
X01_M02_370_010="[{i HQ}]: 你必须让那些卡车到安全地点，指挥官！总部通话完毕。"
X01_M02_380_010="[{i HQ}]: 你在等待邀请还是怎样？到那里去并且消灭那个教团指挥官。总部通话完毕。"
X01_M02_390_010="[{i Dostya}]: 时间紧迫，指挥官。你必须消灭教团指挥官。多斯提亚通话完毕。"
X01_M02_400_010="[{i Rhiza}]: 盖芮让我们所有人蒙羞。消灭她。理萨通话完毕。"
X01_M02_410_010="[{i HQ}]: 看来那个异形发射一枚核弹。飞行弹道显示它的目标是东边城镇。总部通话完毕。"
X01_M02_420_010="[{i Graham}]: 他们已经发射一枚核弹！如果它击中东边城镇，百万人将丧命！"
X02_DB01_011_010="[{i Rhiza}]: 公主已经回归了！我内心充满喜悦！感谢你解救我的「忠诚者」，指挥官。我感觉局势对我们有利。要坚强。我们最终的胜利比你想的还近。"
X02_M01_046_010="[{i Thalia}]: 指挥官，攻击并消灭在东方运作的教团基地。塔丽雅通话完毕。"
X02_M01_047_010="[{i HQ}]: 你东方有一座教团基地。攻击并消灭它。总部通话完毕。"
X02_M01_048_010="[{i Thalia}]: 教团基地仍然在运作，指挥官。拜托，你必须摧毁它这样我们才能解放「忠诚者」囚犯。塔丽雅通话完毕。"
X02_M01_049_010="[{i HQ}]: 到那里去并且摧毁教团基地，指挥官。总部通话完毕。"
X02_M01_152_010="[{i Thalia}]: 赛兰妮基地中的护盾撤除了！趁你可以时攻击她！塔丽雅通话完毕。"
X02_M01_190_010="[{i Dostya}]: 你已经收到轻型炮艇「小丑」的设计图。它主要设计来防守基地，所以好好利用它。多斯提亚通话完毕。"
X02_M01_200_010="[{i Dostya}]: 我们正传送给你「火甲虫」的设计图，指挥官。它是一种机动炸弹。只要移动它进入位置然后引爆。多斯提亚通话完毕。"
X02_M01_210_010="[{i HQ}]: 你已经获准接受「劫掠者」。这是一种打击力强大的点防御系统，而且如果你要击退地面攻击应该非常好用。总部通话完毕。"
X02_M01_220_010="[{i HQ}]: 正在上传「矛头」设计图，指挥官。这是一种机动导弹发射器能够打掉护盾的防护罩以及战术导弹防御系统。玩得开心。总部通话完毕。"
X02_M02_011_010="[{i HQ}]: 首先你必须杀出一条路通过这个垭口。得假设敌人已经占领这整个区域，所以预期会遭受强烈抵抗。"
X02_M02_012_010="[{i HQ}]: 从那里，情况可能会变得更糟糕。我们必须假设敌人在垭口另一边拥有防御工事。"
X02_M02_013_010="[{i HQ}]: 这座监狱关着三位「忠诚者」。如果QAI迫使他们招供，我们就麻烦大了。"
X02_M02_014_010="[{i HQ}]: 占领这座监狱，救出关在那里的「忠诚者」。"
X02_M02_051_010="[{i Thalia}]: 我的间谍准备好出击，指挥官。请透过「命令信号」对他们下达攻击指令。塔丽雅通话完毕。"
X02_M02_171_010="[{i Celene}]: 公主殿下？"
X02_M02_172_010="[{i Princess}]: 教团已经背叛你。评断者凯尔寻求的是绝对的力量，而她将牺牲任何胆敢阻挡她去路的人。该是起来反抗并且拒绝她的教义的时候了，该是对抗那些企图消灭所有人性之人的时候了。以你们公主的名义奋起战斗吧！"
X02_M02_173_010="[{i Celene}]: 公主殿下还活着…我不相信…"
X02_M02_174_010="[{i Rhiza}]: 你听说她还活着，赛兰妮，而你却仍然背叛她。你做出了选择，而现在你将承受后果。"
X02_M02_175_010="[{i Celene}]: 我错了…大错特错。原谅我，公主殿下。"
X02_M02_176_010="[{i Celene}]: 我仍然可以改错归正。"
X02_M02_180_010="[{i Thalia}]: 监狱南方有「忠诚者」部队在运作。如果可能的话，他们会协助你。塔丽雅通话完毕。"
X02_M02_190_010="[{i Thalia}]: 监狱南方有「忠诚者」。拜托，你一定要保护他们。塔丽雅通话完毕。"
X02_M02_200_010="[{i Thalia}]: 「忠诚者」被杀死了。我会哀悼他们的牺牲。"
X02_M03_021_010="[{i Brackman}]: 一旦你摧毁了QAI的ACU，「忠诚者」部队会抵达并扣留瑟拉芬装甲指挥单位。噢是的。然后我将能够破解它的语言阵列。"
X02_M03_022_010="[{i Brackman}]: 请摧毁QAI，我的孩子。我们必须得到那具瑟拉芬ACU。"
X02_M03_310_010="[{i Brackman}]: 「忠诚者」正在途中，指挥官。只要再一会儿，瑟拉芬装甲指挥单位就是我们的了。噢是的。"
X02_M03_320_010="[{i Thalia}]: 侦测到量子识别信号。瑟拉芬即将出现。"
X02_M03_330_010="[{i Thalia}]: 那个瑟拉芬是我们的了。"
X02_M03_340_010="[{i Brackman}]: 干得好，太好了。很快地它所有秘密都会是我们的。"
X03_M01_101_010="[{i HQ}]: 接收到你北方岛屿上增加的活动。不知道那个异形在搞什么鬼，不过他正在建造某个大家伙。眼睛放亮点。总部通话完毕。"
X03_M01_102_010="[{i Rhiza}]: 这座岛是我们的了，指挥官。我们现在可以开始对基地进攻。理萨通话完毕。"
X03_M03_200_009="[{i HQ}]: 该死，那个滑溜的混蛋传送逃走了。"
