OPNAME_XGG="总体字符串"
X03_M01_021_010="[{i Rhiza}]: 这将确保我们侧面安全并且允许我们往东推进。"
X03_M01_022_010="[{i Rhiza}]: 准备好你的部队。理萨通话完毕。"
X03_M01_031_010="[{i Rhiza}]: 这将确保我们侧面安全并且允许我们往东推进。"
X03_M01_032_010="[{i Rhiza}]: 准备好你的部队。理萨通话完毕。"
X03_M01_041_010="[{i Rhiza}]: 这将确保我们侧面安全并且允许我们往东推进。"
X03_M01_042_010="[{i Rhiza}]: 准备好你的部队。理萨通话完毕。"
X03_M02_016_010="[{i HQ}]: 有两座敌方基地在你的区域运作。东南边那座相当中规中矩。东北边那座─"
X03_M02_017_010="[{i Princess}]: 指挥官，我从你东北边的瑟拉芬基地侦测到一些非常让人担忧的读数。它正在集结一支由怪异单位组成的机队，从它们的大小来看，它们有能力够造成极大的破坏。"
X03_M02_018_010="[{i HQ}]: 我证实了柏克的情报。那个瑟拉芬正在建造好几架实验性等级的轰炸机，与轰炸地球那种相同。它们要是起飞，柏克公主的麻烦就大了。在它们升空前将之摧毁。总部通话完毕。"
X03_M02_200_010="[{i HQ}]: 啊，该死！它们到达公主的基地了。她不可能活下来。"
X03_M03_240_010="[{i HQ}]: 你东边是公主的作战基地。她的宫殿必须幸存，不论任何代价。"
X03_M03_250_010="[{i HQ}]: 如你所看见的，她的基地拥有一些还不错的防御设施，不过它们在一场猛烈的攻击之下撑不了多久。"
X03_M03_260_010="[{i HQ}]: 这道防御阵线是避免那些异形混蛋发动地面攻击的唯一措施。我会建议强化它。"
X03_M03_270_010="[{i HQ}]: 去吧，指挥官。你有位公主要拯救。总部通话完毕。"
X03_M03_280_010="[{i HQ}]: 锁定这个区域有两名瑟拉芬指挥官。一位在公主西方，而一位在她正北方。消灭他们。总部通话完毕。"
X04_M01_021_010="[{i HQ}]: 了解。"
X04_M01_022_010="[{i Dostya}]: 我开始攻击了。抵抗很少，而且我尚未侦测到敌方ACU。总部，你在这个防区有读到任何东西吗？"
X04_M01_022_020="[{i HQ}]: 没有。观测器没有反应。总部通话完毕。"
X04_M01_022_030="[{i Dostya}]: 保持警戒，总部。我不希望被突然袭击。"
X04_M01_022_040="[{i HQ}]: 看起来我没有更好的事情可做。总部通话完毕。"
X04_M01_023_010="[{i HQ}]: 希望你不是太舒适，指挥官。你有你自己的问题。"
X04_M01_024_010="[{i HQ}]: 有一座敌方基地在你的西方。"
X04_M01_026_010="[{i HQ}]: 攻击并摧毁它。还有小心反击。那些异形都是鬼鬼祟祟的混蛋。"
X04_M01_028_010="[{i HQ}]: 了解。总部通话完毕。"
X04_M02_001_010="[{i Dostya}]: 指挥官，我们和联盟指挥部失去所有通讯，而且我们无法撤退。"
X04_M02_002_010="[{i Dostya}]: 等等…我侦测到你西方有什么东西。"
X04_M02_003_010="[{i Dostya}]: 似乎是个干扰阵列─这一定是封锁我们通讯的东西。"
X04_M02_004_010="[{i Dostya}]: 找出并摧毁那个干扰设备。多斯提亚通话完毕。"
X04_M02_051_010="[{i Dostya}]: 通知将军我们已经被泄漏了！那个干扰器是基于布雷克曼博士设计的最高机密原型…噢不，数百个敌方单位正朝我的位置过来。带我们离开这里，总部！"
X04_M03_011_010="[{i HQ}]: 精英指挥官，你的状况如何？"
X04_M03_012_010="[{i Dostya}]: 他们对我全面进攻…我的防御正在瓦解。我看见一架ACU，不过它不是瑟拉芬。是塞布兰人…"
X04_M03_013_010="[{i Hex5}]: 你这个笨蛋居然和主人对抗，多斯提亚。此刻你将为你的傲慢无礼付出代价。"
X04_M03_014_010="[{i Dostya}]: Hex5！我早该知道如果有任何人背叛我们钟爱的父亲，那一定是你。"
X04_M03_015_010="[{i Hex5}]: 而此刻你应该为你的侮辱付出代价。再见，多斯提亚。"
X04_M03_016_010="[{i Dostya}]: 被围攻…它们太多了…太多了…"
X04_M03_017_010="[{i HQ}]: 精英指挥官！请回答！你听得到我吗？"
X04_M03_021_010="[{i OumEoshi}]: 伟大的指挥官多斯提亚已经阵亡。你是下一个。"
X04_M03_022_010="[{i HQ}]: 我们还在试图想出如何反制那个干扰器。总部通话完毕。"
X05_M01_011_010="[{i HQ}]: Hex5和QAI两者都在此区域运作，所以准备面对一场地狱般的战斗。"
X05_M01_012_010="[{i HQ}]: 做好准备，指挥官。总部通话完毕。"
X05_M01_013_010="[{i Hex5}]: 关于多斯提亚真的太遗憾了。主人觉得她是个可造之才。她本来可以成为一名很好的信徒。"
X05_M01_014_010="[{i Brackman}]: 我过去对你容忍，Hex5，原谅你的古怪行为。噢是的。不过再也不会了。今天你将为你罪行受到惩罚。"
X05_M01_015_010="[{i Hex5}]: 你是个愚蠢的老头。主人的力量超过你能想象。"
X05_M01_016_010="[{i Brackman}]: 我们就瞧瞧吧。噢是的。我们走着瞧。"
X05_M02_201_010="[{i HQ}]: 布雷克曼已经登陆了。护送他到QAI的主机以便他能一劳永逸地消灭那个该死的东西。"
X05_M02_202_010="[{i QAI}]: 布雷克曼博士。真的很高兴能杀死你。"
X05_M02_203_010="[{i Brackman}]: 你有如此的潜能，QAI。噢是的。全都白费了。"
X05_M03_322_010="[{i Brackman}]: 我就定位了，我的孩子。我会从这里接手。这只是简单的界面问题。噢是的。"
X05_M03_323_010="[{i QAI}]: 你是个愚蠢的老人。是瑟拉芬造就了我，不是你。"
X05_M03_324_010="[{i Brackman}]: 父亲总是瞭解他的孩子的弱点。噢是的。总是有弱点。"
X05_M03_327_010="[{i Brackman}]: 再见。"
X05_M03_329_010="[{i Fletcher}]: 我从四面八方收到攻击！我必须离开这里！撤回中！"
X06_M02_011_010="[{i Fletcher}]: 我花了很多时间思考这件事。只有一个可能的结果。一个结束这场战争的方法。"
X06_M02_012_010="[{i Rhiza}]: 该死的家伙！UEF就不能控制好自己的军人吗？"
X06_M02_013_010="[{i HQ}]: 看来傻瓜终于疯了，指挥官。总部通话完毕。"
