X1T_TU02_010_010="[{i Fletcher}]: 这场演习脑残般简单，不过大官们要我让每个人执行一遍。有两个方法导览战场─使用鼠标和方向键。要使用鼠标，简单地移动光标到地图边缘，它会自动地卷动。按住方向键也有同样的功能。"
