X1T_TU06_150_010="[{i Fletcher}]: 也许我们总有一天会把你造就成一位指挥官。干得好。"
X1T_TU06_160_010="[{i Fletcher}]: 盖好那座防空塔，指挥官。"
X1T_TU06_170_010="[{i Fletcher}]: 如果敌人派来轰炸机，你就成了活靶。建造那座防空炮塔。"
X1T_TU06_180_010="[{i Fletcher}]: 敌人正使用轰炸机攻击。现在你不是很庆幸盖好那座防空塔吗？"
X1T_TU06_OBJ_010_010="建造工程师"
X1T_TU06_OBJ_010_020="从陆军工厂建造两辆工程师"
X1T_TU06_OBJ_010_030="占领发电机"
X1T_TU06_OBJ_010_040="使用你的工程师占领发电机"
X1T_TU06_OBJ_010_050="建造一座点防御"
X1T_TU06_OBJ_010_060="在标示位置建造一座点防御"
X1T_TU06_OBJ_010_070="建造防空塔"
X1T_TU06_OBJ_010_080="在地图上指定位置建造一座防空塔"
X1T_TU07_010_010="[{i Fletcher}]: 你可以建造所有想要的坦克和轰炸机，不过如果你不知道敌人在搞什么鬼，你就像一只手被绑在背后一样战斗。这正是为什么进行战争最重要的部分之一是情报了。雷达是搜集敌人情报的一项重要设备。现在于指定位置建造一座雷达。"
X1T_TU07_020_010="[{i Fletcher}]: 现在你能够持续监控敌人了，干得好。"
X1T_TU07_030_010="[{i Fletcher}]: 建造一座雷达，指挥官。"
X1T_TU07_040_010="[{i Fletcher}]: 如果你瞎了是无法战斗的，指挥官。建造那座雷达。"
X1T_TU07_OBJ_010_010="建造雷达"
X1T_TU07_OBJ_010_020="在指定位置建造一座雷达。"
X1T_TU08_010_010="[{i Fletcher}]: 你的雷达揭露一座小型「教团」基地的存在。建立一支军队并且摧毁那座基地！"
X1T_TU08_020_010="[{i Fletcher}]: 我很爱看到「教团」的单位燃烧。干得好，指挥官。"
X1T_TU08_030_010="[{i Fletcher}]: 彻底消灭那座敌方基地，指挥官。"
X1T_TU08_040_010="[{i Fletcher}]: 我要那座敌方基地被摧毁。搞定它。"
X1T_TU08_OBJ_010_010="摧毁敌方基地"
X1T_TU08_OBJ_010_020="建立一支军队，攻击并摧毁「教团」基地。铲平所有建筑物。"
X1T_TU09_010_010="[{i Fletcher}]: 侦测到北方有一座较大的「教团」基地。我们正派给你援军；把它们加入你的攻击部队并且移平那座敌方基地。我要你铲除所有建筑物。"
X1T_TU09_020_010="[{i Fletcher}]: 干掉一名敌方指挥官了。我很爱看见「教团」指挥官像那样爆炸。"
X1T_TU09_030_010="[{i Fletcher}]: 消灭敌方指挥官。"
X1T_TU09_040_010="[{i Fletcher}]: 你等着那个人渣过来跟你自我介绍吗？攻击并消灭他。"
X1T_TU09_OBJ_010_010="消灭教团指挥官"
X1T_TU09_OBJ_010_020="攻击并消灭敌方指挥官和基地"
X1T_TU10_010_010="[{i Fletcher}]: 要使用威力更强大的武器，你必须升级你的工厂。总共有三种科技等级：科技等级一、科技等级二和科技等级三。要升级至科技等级二，选择你的陆军工厂，然后点击升级图示。"
X1T_TU10_010_020="[{i Fletcher}]: 升级你的陆军工厂至科技等级二。"
X1T_TU10_020_010="[{i Fletcher}]: 太好了。你现在可以建造科技等级二单位和工程师。"
X1T_TU10_030_010="[{i Fletcher}]: 我们升级那座陆军工厂吧，指挥官。"
X1T_TU10_040_010="[{i Fletcher}]: 要赢得这场战争必须要有比豌豆发射器还好的东西，指挥官。升级你的工厂。"
X1T_TU10_OBJ_010_010="升级工厂"
X1T_TU10_OBJ_010_020="升级你的工厂至科技等级二。"
X1T_TU11_010_010="[{i Fletcher}]: 如果你做了功课，你就知道大多数作战发生在大规模的战场。运输机是移动部队越过广大距离最有效的方式。运输机的使用有好几种方法，所以检查你的战场手册。针对这次演习的目的而言，我们只打算涵盖基本的使用方法，而且我们已经给了你一艘运输机。"
X1T_TU11_010_020="[{i Fletcher}]: 要装载运输机，选择你想运输的单位，然后右击那艘运输机。一旦运输机满载，选择它，点击运输图示，然后点击运输机应该在地图上卸载的地方。"
X1T_TU11_020_010="[{i Fletcher}]: 现在你了解基础运输的方法了。干得好。"
X1T_TU11_030_010="[{i Fletcher}]: 运输这些单位，指挥官。"
X1T_TU11_040_010="[{i Fletcher}]: 装载那艘运输机，指挥官。"
