FMV_VO_Opening_010_010="多数敌人正接近这个位置。让那艘船舰离开这里。"
FMV_VO_Opening_010_020="引擎上线。只要再几分钟。"
FMV_VO_Opening_010_030="敌人出现在屏幕上。预计拦截时间，四分钟。那是你的最佳时机。"
FMV_VO_Opening_010_040="了解。"
FMV_VO_Opening_010_050="遭受猛烈攻击。我该死的支援在哪里？"
FMV_VO_Opening_010_060="瞄准敌方部队。"
FMV_VO_Opening_010_070="也该是时候了。在我们的北方建立防御阵线。"
FMV_VO_Opening_010_080="别自以为是指导我该怎么战斗，克拉克。"
FMV_VO_Opening_010_090="做就是了。我们之后可以辩论。"
FMV_VO_Opening_010_100="主引擎发动。启动轨道已测定。"
FMV_VO_Opening_010_110="开始撤回；从这里开始那艘船得靠自己了。"
FMV_VO_Opening_010_120="5秒内撤回、4、3、2、1。"
FMV_VO_Opening_010_130="船舰被击中！它坠落了！"
FMV_VO_Opening_010_140="撤回，克拉克！撤回！"
FMV_VO_Opening_010_150="快啊，你这个混蛋。"
FMV_VO_Opening_010_160="快啊，你这个该死的家伙。"
FMV_VO_Opening_010_170="你们这些混帐东西。"
FMV_VO_Opening_020_010="瑟拉芬从量子裂缝大量涌入，他们的战争机器散播死亡和毁灭。地球在三天内被攻陷。无人存活。"
FMV_VO_Opening_020_020="我被迫躲藏。因为瑟拉芬相信只有一个种族能凭借着「道」超凡入圣，我的新能力使他们整个信仰体制陷入怀疑。瑟拉芬会寻求人类的灭绝。"
FMV_VO_Opening_020_030="大部分万古人民相信他们的神回归了，于是欢迎瑟拉芬并且加入他们毁灭的战役。只有理萨和少数人仍然对我忠诚。他们发动对抗「教团」和瑟拉芬的游击战争。"
FMV_VO_Opening_020_040="无数由UEF和塞布兰控制的世界被消灭。他们被逼到绝境，由于他们的生存岌岌可危，UEF和塞布兰成立一个不稳定的联盟。理萨和其它「忠诚者」加入了他们。"
FMV_VO_Opening_020_050="瑟拉芬和他们的万古盟友已经在整个宇宙猎杀人类将近三年，屠杀每一个他们碰见的人。"
FMV_VO_Opening_020_060="该是反击的时候了。"
VO_Credits_Credits_010_010="注视着你的面容，我看见慰藉、愉悦和胜利感。无庸置疑，除了庆祝我们的胜利，你什么也不要。毕竟，瑟拉芬和「教团」撤退了，而QAI已不复存在。"
VO_Credits_Credits_010_020="不过我警告不要过度的大肆庆祝。我们也许赢了这一天，不过这是用重大牺牲换来的胜利。我们的情势不稳定，而且威胁依然从四面八方逼近。"
VO_Credits_Credits_010_030="其中最危险的不是出自于瑟拉芬，而是我们自己。"
VO_Credits_Credits_010_040="我们必须做出一个非常简单的抉择。我们愿意原谅之前的敌人并且永远承认我们与他们享有的共同之处吗？"
VO_Credits_Credits_010_050="或者我们退回我们一直深信的理念呢？我们要让恐惧、怨恨和猜忌支配我们的行动吗？当面对不了解的事物时，我们要以暴力回应吗？为了我们所有人的利害关系，那不能发生。"
VO_Credits_Credits_010_060="我不容许那件事发生。"
VO_Credits_Credits_010_070="即刻生效，联合地球联邦正式承认塞布兰国和万古启示的独立。两个国家对他们目前以及历史上的领土拥有完整而且合法的权利。在不久的将来，我希望在三个阵营间结成永久的联盟关系。"
VO_Credits_Credits_010_080="我们一直梦想银河系的团结，人类兄弟和姊妹的和解。终于那个梦想实现了。而我祈祷我们永远不会忘记是什么带给我们这一刻─不是炮管，而是和平的乐观主义。"
VO_Credits_Credits_010_090="愿它永存。"
VO_Credits_Credits_020_010="公主殿下消失了。没有她的留下来的迹象。"
VO_Credits_Credits_020_020="毫无疑问这是伤心和悲伤的一天。不过我们不会失去公主殿下支持的主张、她追求她人民的未来。为了我们最后一口气，我们必须以她的名字战斗。"
VO_Credits_Credits_020_030="不这么做就是对它的记忆和牺牲的侮辱。"
VO_Credits_Credits_020_040="尽管我们精疲力竭、尽管我们背痛懊悔，这正是为什么我们必须追捕并且根除所有「教团」残存的背叛者。我们将消灭剩余的瑟拉芬局部抵抗。"
VO_Credits_Credits_020_050="我们将确保这些因素绝不会再次威胁人类。"
VO_Credits_Credits_020_060="而在对抗「教团」和瑟拉芬邪恶的最终战斗后，我们应该放下我们的武器。从那天起，「道」将用于发扬美好事物及和平。绝不能再次让它沦为武器或是成为杀戮及战争的借口。"
VO_Credits_Credits_020_070="那是公主殿下为我们安排的道路。而且那是我们应该遵循的道路。"
VO_Credits_Credits_030_010="我已经接到从赫尔将军传来的消息，UEF正式承认塞布兰国及其成员为一主权独立的国家。噢是的。我们现在能自由过着我们认为合适的生活了。"
VO_Credits_Credits_030_020="赫尔也提议在我们双方人民之间成立一个永久的联盟。关于这项提议，我暂时而且以沉重的心情拒绝了。"
VO_Credits_Credits_030_030="我的孩子们，我们自由了。不过自由代表什么？它意味着我们放弃我们的人民并且与怪物们结盟吗？就因为自我的利益和贪婪，我们便要遗弃我们的兄弟和姊妹吗？"
VO_Credits_Credits_030_040="或者它代表我们肩负起天生追求自由的责任并且以谦卑和感恩的心带着它前进？代表我们把公益置于我们自己的利益之上？噢是的。对我来说，那是追求自由的意义。对我们所有人的意义。"
VO_Credits_Credits_030_050="现在要紧的是治愈塞布兰国内的破裂伤口。要让所有节点生活在和平与和谐之中。噢是的。过着和平的生活。"
VO_Credits_Credits_030_060="不过还有更多事情。要做的事总是很多。"
VO_Credits_Credits_030_070="我们将尽一切可能继续协助我们的姊妹理萨。他们的战斗就是我们的战斗。我们必须宽恕。协助那些曾经是我们最惧怕的敌人。"
VO_Credits_Credits_030_080="那是前进的道路。噢是的。那是前进的道路。"
VO_Credits_Credits_030_090="要安全，我的孩子们。要安全。"
VO_Credits_Credits_040_010="啊啊啊啊！"
