Unit_Description_0441="快速移动，重装甲攻击机器人。配备格林等离子加农炮以及重型破片榴弹发射器。"
Unit_Description_0442="机动支持单位。设计来攻击及摧毁敌方护盾。武器系统对付敌方单位起不了多大的效用。"
Unit_Description_0443="格林式迫击炮发射器能以良好的准确率发射高爆弹药。"
Unit_Description_0444="轻型火箭机器人。设计用于在长距离摧毁重装甲单位。"
Unit_Description_0445="没有武装的匿踪潜水艇，设计来执行侦察任务。配备反鱼雷诱导弹。"
X1MP_001_Description="被游击队战士使用作为避难所已经有好几世纪了，「沙丘」在崎岖的岩壁之中提供许多藏匿点。随着瑟拉芬的到来，这些岩壁再次成为那些寻求避难之人的家。"
X1MP_002_Description="在地球帝国衰退的时日，这是指挥官威廉森英勇对抗万古初次入侵的地点。最近的事件已经将威廉森指挥官和他曾经防守的桥梁转变成希望和UEF人民勇气的象征。"
X1MP_003_Description="「哈洛迪得」是联盟初次胜利的地点，塞布兰指挥官索尼坚守他的阵地抵御瑟拉芬的压倒性的武力直到UEF能够到来并且协助防御「三贝塔零」殖民地。这处塞布兰殖民地由于邻近前线，自从那时就被撤离。"
X1MP_004_Description="逃离无尽的战争的蹂躏，UEF殖民者在「暗礁避难所」定居，希望它能成为他们的避难处。由于富含资源，「暗礁避难所」欣欣向荣，不过那场兴盛只是昙花一现。所有纪录都失落了，但是据信殖民者受到一场不明的疾病消灭。UEF否认这项谣言并且把所有关于「暗礁避难所」的情报列为机密。"
X1MP_005_Description="座落于一处内陆三角洲，此区域一直是反抗军、游击队以及走私客的家园。自从瑟拉芬入侵以来，「哈特」已经成为银河系中少数非军事瑟拉芬殖民地。"
X1MP_006_Description="「万古」相信这颗行星与「道」有着特殊的连接，所以他们在最高的山脊建立一处隐居所。他们的目的是使这里成为一个和平与冥想的地方。遗憾的是，战争严酷的现实到来，而且曾经应该是学习之地如今成了杀戮战场。"
X1MP_007_Description="一处位于已知宙域边缘的UEF开矿殖民地，殖民者们已经拒绝所有出自同盟所提供的协助。这处殖民地拥有的秘密尚未被发现，但是他们似乎对瑟拉芬造成的威胁漠不关心。"
X1MP_008_Description="曾经是个对公主和她的助手有着强大力量的地方，由于恐惧被「教团」维和者所补，「万古忠诚者」已经被迫放弃这个地点。"
X1MP_009_Description="当瑟拉芬初次到来时，它们不确定这个星系的资源是否足够运作他们的战争机器，所有他们在这个行星植入罕见的「利伯安」水晶。然而，「教团」科学家终于说服瑟拉芬当地的质量资源能够处理他们所有的质量需求。"
X1MP_010_Description="「万古」相信这颗行星受到「道」的祝福，好几世代以来他们保护它免于被有知觉的生命体发现。既然联盟的资源短缺，绝望使得那项禁令被解除。"
X1MP_011_Description="由于资源集中在「手里剑」中间地带，指挥官们必须尽快地推进到中央。然而，那些过度拓展自己的人可能没有第二次机会。"
X1MP_012_Description="据传这里曾经是一个繁荣的岛屿共同社会的家园，不过一场大爆炸拆散了岛链。今日，探险家持续挖掘地底深处以寻找究竟发生何事的答案。"
X1MP_014_Description="在夏季期间，露天矿床底部会淹水，避免殖民者完成工作。近来，殖民地已经切断所有与UEF的通讯，而且联盟发送的任何信号都受到忽略。这个世界的状态及其殖民地仍然不明。"
X1MP_017_Description="一种奇怪的异常现象使得量子通讯在这个世界难以实行。然而，那不能避免联盟和瑟拉芬两者盯上这颗行星作为一处绝佳的集结场来对敌人领土进行秘密攻击。"
